(3, 'quality_and_environmental_management', 'en', 6, 'Quality & Environmental Management', '4th', '2', '<div class="article artSty">\n <p class="intro">\n        The life of an enterprise depends on its quality products, like that of a human relies upon healthiness; the core competence of products shall base on its superior performance and reliable quality.\n    </p>\n<br>\n<img src="http://thsl.zenho.net/uploads/14284076313898.gif" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14284076304709.gif" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14295347271146.jpg\n" width="160" height="106">\n<br><br>\n\n    \n<div class="article artSty">\n    <h2>Quality Policy </h2>\n   \n    <ul class="list_4 list_4_1">\n        <li>\n            Continuous innovation, Technology improving; \n        </li>\n        <li>\n            Efficiency improving, Consumption minimizing;\n        </li>\n        <li>\n           Customer satisfaction, Win-win\n        </li>\n\n    </ul>\n</div>\n<div class="article artSty">\n    <h2>Quality Objective </h2>\n   \n    <ul class="list_4 list_4_1">\n        <li>\n            Shipment pass rate=100%;\n        </li>\n        <li>\n            Customer complaint=0;\n        </li>\n        <li>\n           Customer satisfaction rate&gt;98%\n        </li>\n\n    </ul>\n</div>\n<div class="article artSty">\n    <h2>Environmental policy </h2>\n<ul class="list_4 list_4_1">\n        <li>\n            All staff participation, continuous improvement;\n        </li>\n        <li>\n            Compliance with laws and regulations, saving resources;\n        </li>\n        <li>\n           Preventing pollution and protect the environment.\n        </li>\n\n    </ul>\n</div>\n<div class="article artSty">\n    <h2>Environmental Objective </h2>\n<ul class="list_4 list_4_1">\n        <li>\n            Major environmental accident=0;\n        </li>\n        <li>\n            Annual energy consumption reduced&gt;1%\n        </li>\n        <li>\n           Staff environmental awareness training rate=100%\n        </li>\n<li>\n           The pollution emissions to achieve the national standard=100%\n        </li>\n<li>\n           Waste classification accuracy=100% \n        </li>\n\n    </ul>\n</div>\n<br>\n    <p>\nQuality is to Finecables what health is to human beings; the core competence of products shall base on its superior performance and reliable quality. Our commitments on "high quality" come from our team''s comprehensive understanding in quality. We have designed strict audit and quality control process to assure ourselves and our suppliers are offering the best practice. ISO 9001:2008 and ISO 14001:2004 represent our quality value.\n    </p>\n</div>', '', 1417795200, 1442632545, 0, '', ''),
(4, 'corporate_culture', 'en', 6, 'Corporate Culture', '2nd', '', '<div class="article artSty">\r\n    <p class="intro">\r\n        "Passion for Connection!" It outlines Finecables'' corporate culture. With great enthusiasm, Finecables is committed to connectivity industry and makes efforts to build long-term partnership and win-win cooperation with both customers and suppliers. In a word, we are your right business partner!\r\n    </p>\r\n   <img src="http://thsl.zenho.net/uploads/14295344783702.jpg\r\n" width="500" height="281">\r\n<br><br>\r\n    <h2>Our Philosophy</h2>\r\n    <ul class="list_4 list_4_1">\r\n        <li>\r\n            Our Vision: To be the world''s leading manufacturer in connectivity industry.\r\n        </li>\r\n        <li>\r\n            Our Mission: Focus-on the customers,to be committed to provide them with reliable and innovative connectivity products and excellent service as well.\r\n        </li>\r\n        <li>\r\n            Our Business Policy: Initiative and Self-improvement,Innovation and Development, Partnership and Cooperation.\r\n        </li>\r\n        <li>\r\n            Our Core Value: Rapidity, Excellence, Crisis awareness, Gratitude.\r\n        </li>\r\n        <li>\r\n           Finecables Spirit: Respect and compliance with covenants, No excuse; Rapid action and respond; Practical deed and effect Orientation; Pursuit of being excellent.\r\n        </li>\r\n    </ul>\r\n</div>\r\n<div class="article artSty">\r\n    <h2>Customer Focus Strategy </h2>\r\n\r\n    <p>\r\n       Serving our customers is the only reason Finecables exists; Customer demand is the fundamental driving force of our development.\r\n    </p>\r\n    <ul class="list_4 list_4_1">\r\n        <li>\r\n            High quality, excellent service, low operating costs, and giving top priority to meeting customer requirements to enhance their competitiveness and profitability.\r\n        </li>\r\n        <li>\r\n            Continuously improve our management level to realize efficient process-based organization operation for ensuring high quality.\r\n        </li>\r\n        <li>\r\n            Developing with our peers in the industry as both competitors and partners to jointly create a favorable environment and share the benefits of the value chain.\r\n        </li>\r\n\r\n    </ul>\r\n</div>\r\n<div class="article artSty">\r\n    <h2>Cost Efficiency &amp; Rapid Response </h2>\r\n\r\n    <p>\r\n        Cost turns out to be one of the important factors to drive outsourcing globally. Finecables implements strictly 7S management system and continuous manufacturing process improvement, while the cost in China is much below that of other American and European countries. Beside cost and expertise, the turnaround time to accomplish a project is also crucial in business as the market is struggling and volatile. We understand some of our clients have strict time requirement for their business needs. Finecables has achieved quick turnaround by strict management and effective communication way.\r\n    </p>\r\n</div>', '', 1427583600, 1442543140, 0, '', ''),
(5, 'history', 'en', 6, 'History', '3rd', 'aa', '<div class="article">\n    <p class="intro">\n        Taking time as X-axis and technology innovation as Y-axis,   Finecables makes every progress to present its young but passionate history.\n    </p>\n<br>\n    <h2>Finecables Milestones</h2>\n    <div class="dl_list2">\n        <dl>\n<dt>\n                2014\n            </dt>\n            <dd>\n                Nov.---Finecables Inc. branch established in Seattle, WA. USA\n            </dd>\n            <dd>\n                Oct.---Being American NMEA member\n            </dd>\n            <dd>\n                Sep.---North China sales office established in Hebei Province\n            </dd>\n<dd>\n            Jun.---Japan sales office established in Tokyo, Japan \n            </dd>\n        </dl>\n        <dl>\n            <dt>\n            </dt><dt>\n                2013\n            </dt>\n            <dd>\n                Oct.---ISO 14001:2004 EMS certified by TÜV SÜD\n            </dd>\n            <dd>\n                Aug.---“Thanksgiving for You” FC 10th Anniversary Celebration\n            </dd>\n        </dl>\n        <dl>\n            <dt>\n                2012\n            </dt>\n            <dd>\n                Feb.  Factory: CSA Certified\n            </dd>\n            <dd>\n                Mar.---UL Certificates for 50+ items of M12 Sensor Connectors \n            </dd>\n            <dd>\n                Feb.---CE certificates for M23 Series Products\n            </dd>\n        </dl>\n        <dl>\n            <dt>\n                2011\n            </dt>\n            <dd>\n                Oct.---East China Office established in Suzhou Industrial Park\n            </dd>\n            \n        </dl>\n        <dl>\n            \n            <dt>\n                2009\n            </dt>\n            <dd>\n               Jul.---European Customer Service Center established in UK\n            </dd>\n        </dl>\n        <dl>\n            <dt>\n                2008\n            </dt>\n            <dd>\n                Jun.---UL certificates for M12 Sensor Connectors: \n            </dd>\n\n        </dl>\n        <dl>\n            <dt>\n                2007\n            </dt>\n            <dd>\n                Jun.---CE certificates for M12/M8 Sensor Connector Series\n            </dd>\n            <dd>\n                Mar.---UL certificates for Wire/Cable Harness\n            </dd>\n        </dl>\n        <dl>\n            <dt>\n                2005\n            </dt>\n            <dd>\n                May---Factory site moved to Humen Town, Dongguan City.\n            </dd>\n            <dd>\n                Apr.---ISO 9001:2000 QMS certified by TÜV SÜD\n            </dd>\n           \n\n        </dl>\n       \n        <dl>\n            <dt>\n                2003\n            </dt>\n            <dd>\n               Aug.---Established in Nanshan District, Shenzhen\n            </dd>\n           \n        </dl>\n    </div>\n</div>', '', 1427472000, 1442632492, 0, '', ''),
