(33, 'company_profile', 'en', 6, 'Company Profile', '1st', 'f', '<div class="article line01">\n    <h2>About Finecables</h2>\n    <img src="http://thsl.zenho.net/uploads/14277029817026.jpeg" width="167" height="140" class="box3_img">\n    <p>\nFinecables Enterprise Co., Limited, established in 2003, is committed to being the world''s leading manufacturer in connectivity industry. At Finecables, with a customer focus and a wealth of practical industry experience, we strive to provide customers in the world with reliable and innovative connectivity products and excellent services as well. Meanwhile, we continue to extend our portfolio by developing customized products for various applications, which cover not only industrial connectors, but also electronic interconnection and data networking. To be your one-stop OEM/ODM sourcing for all custom-designed solutions is our goal. Moreover, "respect and compliance with covenants and no excuse", "rapid action and respond", "practical deep and effect orientation", and "pursuit of being excellent" comprise Finecables'' service spirit.\n\n    </p>\n\n    <ul class="list_4">\n    </ul>\n</div>\n<div class="article">\n    <h2>Products</h2>\n    <img src="http://thsl.zenho.net/uploads/14277038495430.jpeg" width="170" height="140" class="box3_img">\n    <p>\n<br>\n<br>\nAs a professional wire harness and industrial connector manufacturer, through continuously innovative strength and highly in-depth development and manufacturing, Finecables has expanded a large variety of product portfolio:\n    </p>\n\n <ul class="list_4 list_4_1">\n        <li>\n            Circular Connectors for industrial applications: (M5/M8/M10/M12/M16/M20/\n            7/8"/M23/RD24) \n        </li>\n        <li>\n            Solenoid Valve Connectors for Pneumatic, hydraulic and electro-magnetic \n            applications (Size A/B/C)\n        </li>\n        <li>\n            Industrial I/O Connectors for data transmission network (USB/RJ45/Mini-Din/\n            D-SUB/UHF/HDMI)\n        </li>\n        <li>\n         ISO-BUS Connectors and Junction Boxes for field-BUS network control (4/6/8-port  \n         M8/M12 connectors with 7/8"/M23 connectors) \n        </li>\n <li>\n         Temperature Sensors and Wire/Cable Harness\n        </li>\n <li>\n         Customized Solutions\n        </li>\n    \n</ul></div>\n\n<div class="article">\n    <h2>R&amp;D</h2>\n    <img src="http://thsl.zenho.net/uploads/14277016630315.gif" width="167" height="140" class="box3_img">\n    <p>\nBased on our years of experience and technology accumulation in connectivity industry, supported by our powerful productivity and tooling ability, Finecables'' R&amp;D team, make full use of our competitive advantages, to research and develop innovative total solutions, seamlessly meeting customer-specified requirements. \n    </p>\n<br>\n<br>\n    <p>\nFinecables fulfills its core value of  Rapidity, Excellence, Crisis \nAwareness, and Gratitude, by insisting our long-term partnership\nand win-win cooperation with both customers and suppliers, to\nfollow our business philosophy-- "Passion for Connection!"\n    </p>\n</div>', '', 1427644800, 1442632480, 0, 'company profile Finecables', ''),
(34, 'patents_and_certificates', 'en', 6, 'Patents & Certificates', '', '', '<div class="article artSty">\n    <h2>Patents &amp; Certificates</h2>\n\n    <div class="patents-certificates">\n\n        <ul class="clearfix">\n            <li>\n                <img width="124" height="180" alt="" src="../assets/images/certificates/certificates_03.jpg">\n                <a href="/uploads/-991834199.pdf" target="_blank">ISO 14001：2004</a>\n            </li>\n\n\n            <li>\n                <img width="124" height="180" alt="" src="../assets/images/certificates/certificates_03.jpg">\n<a href="/uploads/-991199520.pdf" target="_blank">  ISO 9001：2008</a>\n            </li>\n\n     <li>\n          <img width="124" height="180" alt="" src="/uploads/14362058153727.jpg">\n<a href="/supports_services/article?id=64&amp;page=2" target="_blank">Patents</a>\n     </li>\n\n\n     <li>\n          <img width="124" height="180" alt="" src="/uploads/14362064534635.jpg">\n<a href="/supports_services/article?id=64&amp;page=1" target="_blank">UL Certificates</a>\n     </li>\n\n     <li>\n          <img width="124" height="180" alt="" src="/uploads/14362057917936.jpg">\n<a href="/supports_services/article?id=64&amp;page=3" target="_blank">CE Certificates</a>\n     </li>\n\n\n     <li>\n          <img width="124" height="180" alt="" src="/uploads/14362058042329.jpg">\n<a href="/supports_services/article?id=64&amp;page=5" target="_blank">IP Ratings</a>\n     </li>\n\n\n           \n        </ul>\n    </div>\n</div>', '', 1417536000, 1442632797, 0, '', ''),
(35, 'human_resources', 'en', 6, 'Human Resources', '', '', '\n					<div class="article artSty">\n						\n						<h2>Recruitment</h2>\n						<p>\n							Training &amp; Vocational Development information\n						</p>\n <ul class="list_4 list_4_1">\n        <li>\n            Employment and related decisions at FINECABLES are determined by ability and performance.\n        </li>\n        <li>\n            Providing a flexible, productive working environment.\n        </li>\n        <li>\n            Encouraging relationships based on trust, courtesy, and mutual respect.\n        </li>\n        <li>\n            Valuing each employee for the particular knowledge and skills he or she contributes to FINECABLES.\n        </li>\n        <li>\n            Supporting continuous development of the individual through lifelong learning.\n        </li>\n<li>Promoting employee involvement in meeting the challenges of a growing and changing market</li>\n<li>Working together to make FINECABLES successful</li>\n    </ul>\n\n<div style="margin: 1em 0em; padding: 1em; text-align:center;background-color: #f0f8fb;">\n<p>To join Finecables China, please click"<a href="http://dg.job5156.com/corp/176648" target="_blank">Job Application Online</a>", or please email your resume to <a href="mailto: admin_wmj@finecables.com">admin_wmj@finecables.com</a></p>\n</div>\n\n						<h2>Benefits</h2>\n						<p>\n							Performance &amp; Reward information\n						</p>\n<ul class="list_4 list_4_1">\n        <li>\n            FINECABLES reward employees’ contributions and qualifications, instead of degree, experience, seniority or title.\n        </li>\n        <li>\n             Our performance management is designed result-oriented. Managers are responsible for helping staff to improve their performance and capability through continuously setting goals, coaching, appraising and communication.\n        </li>\n        <li>\n           FINECABLES introduced FA (FINECABES AWARDS) in 2003. Honoring employees who have applied special technology and knowledge to create enhanced value for FINECABLES, this award is designed to motivate employees to pursue greater challenges and achievements.\n        </li>\n    \n    </ul></div>\n\n<div class="article artSty">\n    <h2>Tranings</h2>\n<p>\nWe commit to build up a learning organization, which continuously improves working skills and performance of employees by running a professional training system, so that the company’s human capital would be appreciated. The HR department takes the responsibility of managing the training of FINECABLES, by cooperating with the training staff in each functional department. For employees, FINECABLES provides new employee orientation program, in-service training program. The new employee orientation program includes a series of training courses, which are corporate culture, operation instructions, products knowledge, marketing and sales skills, product developing standards, etc. To ensure that every new employee could meet the skill requirements before going to the post, the training programs vary from half to 6 months based on working positions. The in-service training program includes management skill training and technical skill training. Based on the vocational qualification standards, we set training plans for all the employees at different level and of different category, providing system solution for career development of every employee.\n</p>\n</div>', '', 1417363200, 1442888694, 0, 'Career tom', ''),
(36, 'global_distributors', 'en', 2, 'Global Distributors', 'NA', '', '					<div class="article header-bg-gray">\r\n						<p>\r\n							Finecables listens to every single word from its customers. We also value every business opportunity, no matter how large or small. If you’d like to enquire or comment about any aspect of our service, please refer to below our contacts:\r\n						</p>\r\n					</div><br>\r\n\r\n					<div class="map-box">\r\n						<img src="../assets/images/contact-us/map_03.jpg" alt="">\r\n					</div>\r\n<br><br>\r\n					<div class="article addrList">\r\n						<h2>Korea Sales Contacts\r\n						<img src="http://thsl.zenho.net/uploads/14202576197936.png\r\n" width="30" height="30">\r\n						</h2>\r\n						<h3>Creken Co.,Ltd</h3>\r\n						<ul class="list_5">\r\n\r\n							<li>\r\n								<i class="icon-user"></i> Mr. Ken Park\r\n							</li>\r\n							<li>\r\n								<i class="icon-phone"></i>Tel：070-7842-2003\r\n							</li>\r\n							<li>\r\n								<i class="icon-mobile-phone"></i>Mobile：010-4524-1999\r\n							</li>\r\n							<li>\r\n								<i class="icon-file-text"></i>Fax：02-498-1505\r\n							</li>\r\n							<li>\r\n								<i class="icon-envelope"></i>Email：ken@creken.co.kr\r\n							</li>\r\n							<li>\r\n								<i class="icon-location-arrow"></i>Address：#908 9th floor Yeong Dong Techno Tower, Seongsu-Dong 2Ga, Seongdong-Gu, Seoul, South Korea 133-120\r\n							</li>\r\n						</ul>\r\n					</div>\r\n<br><br>\r\n					<div class="article addrList">\r\n						<h2>Israel Sales Contacts\r\n						<img src="http://thsl.zenho.net/uploads/14202576197237.jpeg\r\n" width="30" height="30">\r\n						</h2>\r\n						<h3>Migvan Technologies &amp; Engineering Ltd</h3>\r\n						<ul class="list_5">\r\n\r\n							<li>\r\n								<i class="icon-user"></i> Mr. Orir\r\n							</li>\r\n							<li>\r\n								<i class="icon-phone"></i>Tel：070-7842-2003\r\n							</li>\r\n							<li>\r\n								<i class="icon-mobile-phone"></i>Mobile：010-4524-1999\r\n							</li>\r\n		