(42, 'm12_shielded_connector_upgraded', 'en', 42, 'M12 Shielded Connector Upgraded', 'The upgraded M12 shielded\nconnector looks nicer, and its hexagonal screw/nut enables its installment more conveniently.', '/uploads/M12-Shielded-Connector.gif', '<div class="products-releases">\n    <h2>M12 Shielded Connector Upgraded </h2>\n    <small>March 16th, 2015</small>\n    <p>\n        <img src="http://thsl.zenho.net/uploads/14287587188447.jpg\n" width="450" height="318">\n    <img src="http://thsl.zenho.net/uploads/14287587181524.jpg\n" width="450" height="318">\n    </p>\n\n    <p>\n        Dear Sir/Madam,<br><br>\nWe are glad to inform you that our shielded version of M12 male/female over-molded cable\nconnector has been already improved in both shape and performance. The upgraded\nconnector looks nicer, and its hexagonal screw/nut enables its installment more conveniently.\n\n<br><br>\nPlease kindly be noted that we will apply to the new version of M12 shielded connector\nimmediately for any new projects or orders. Please find the improvement details on below\nseparate pages.<br><br>\n\nThanks and have a great day.<br><br>\n\nBest Regards,<br>\nDongguan Finecables Co., Ltd\n    </p>\n\n    <div class="a-jump">\n        \n        <a title="DOWNLOAD" href="/uploads/M12_Shielded_Connector_Upgraded-Finecables.pdf" target="_blank">\n            <img src="../assets/images/news/a-jump_05.jpg" alt="DOWNLOAD">\n        </a>\n    </div>\n\n</div>', 'M12-Shielded-Connector.gif', 1426435200, 1442632914, 1, '', ''),
(43, 'm8_junction_box,_4/6/8_ports', 'en', 42, 'M8 Junction Box, 4/6/8 Ports', 'Junction Box, 8/6/4 ports, M8 termination, with M12 connector or molded on cable, are available for your options. ', '/uploads/327.jpg', '<div class="products-releases">\n    <h2>Junction Box, 4/6/8 Ports, M8 Termination </h2>\n    <small> October 31st, 2014</small>\n    <p>\n        <img src="http://thsl.zenho.net/uploads/002.jpg" width="450" height="200">\n    </p>\n\n    <p>\n        For the cost-effective signal transfer with only one core cable or one input connector, Finecables offers you the multi-port Junction Boxes with M8 Termination in field control. This allows for 4/6/8 ports to be connected, with/without M12 male connector for signal transmission. The design with LED indicators can help you judge whether the circuits work well.\n\nMost importantly, we provide customized solution which makes the products better suit for the working circumstance.\n    </p>\n\n    <div class="a-jump">\n\n        \n        <a title="DOWNLOAD" href="/uploads/Junction Box.png" target="_blank">\n            <img src="../assets/images/news/a-jump_05.jpg" alt="DOWNLOAD">\n        </a>\n    </div>\n\n</div>', '327.jpg', 1414684800, 1442633053, 0, 'M8 Junction Box with M12 Conn.', ''),
(44, 'tug_of_war_of_finecables', 'en', 43, 'Tug of War of Finecables', 'September 10th, 2014 <br>\nFinecables healthy activity: Tug of War for all staff. Finally Goup One get the first place. Congratulations!', 'http://thsl.zenho.net/uploads/拔河.jpg', '<div class="company_news_leve">\n    <h2>Healthy Activity: Tug of War</h2>\n<br>\n    <small>September 10th, 2014</small>\n    <br><br>\n        <img src="http://thsl.zenho.net/uploads/14284999803328.jpg\n" alt="" width="150px">\n     <img src="http://thsl.zenho.net/uploads/14284999773331.jpg\n" alt="" width="150px">\n     <img src="http://thsl.zenho.net/uploads/14284999787527.jpg\n\n" alt="" width="150px">\n    <br>\n\n    <p>\n        Every month Finecables will organize one kind of healthy group activity, in order to enrich our life, keep our health and increase our teamwork spirit.<br><br>\nThis month, "Tug of War" is held. After a strong competition, the group of "Domestic Production" finally win. Congratulations.\n    </p>\n\n</div>', '', 1410278400, 1442633235, 1, '', ''),
(46, 'electronica_china_(shanghai)', 'en', 44, 'electronica China (Shanghai)', 'March 12-15, 2015   <br> Booth No. E5-5234 <br>Shanghai New International Expo Center. <br>Welcome to Finecables booth!', '/uploads/electronica-logo.gif', '<div class="exhibitions-detail">\n    <h2>The last Exbition 2015</h2><br>\n\n    <small>electronica China (Shanghai)</small><br>\n\n<div class="clearfix dl-list">\n    \n    <img width="200" height="80" class="box3_img" alt="展会命名" src="http://thsl.zenho.net/uploads/14284935159817.jpg">\n    <p>\nDate: March 12~15, 2015<br>\nBooth No.: E5-5234<br>\nAddress: Shanghai New International Expo Center, China<br>\nExhibition Website: http://electronica-china.com\n    </p>\n\n<br>\n<p>Exhibition Profile: electronica China is now one of the leading platforms for electronic components, systems and applications. The fair has been one of the most important events in Asia since 2002. Welcome to electronica China!\n<br>We are expecting to meet you at our booth!\n</p>\n    <ul class="list_4">\n    </ul>\n</div>    \n</div>\n    ', 'electronica-logo.gif', 1426348800, 1442633362, 0, '', 'http://thsl.zenho.net/uploads/1111.jpg\nhttp://thsl.zenho.net/uploads/0000.jpg\nhttp://thsl.zenho.net/uploads/14284962332970.gif\nhttp://thsl.zenho.net/uploads/14284962266601.gif\nhttp://thsl.zenho.net/uploads/14284962257685.gif\nhttp://thsl.zenho.net/uploads/14284962253648.gif\n'),
