(51, 'chinese_cities', 'en', 49, 'Chinese Cities', '', '/uploads/14202538632611.jpeg', '<p>Detailed introduction to over 300 Chinese cities displays the destinations'' tours, attractions, hotels, transportation, weather, pictures, maps and travel tips, etc. You can enjoy your experience on China travel with tourists all over the world!</p>\n\n<div class="article">\n\n    <dl class="business-trip-service">\n\n <li>\n                <img width="280" height="180" alt="" src="/uploads/14202538632611.jpeg">\n <br> <br> <br>\n<a href="http://www.travelchinaguide.com/cityguides/" target="_blank">Chinese Cities</a>\n </li>\n\n   </dl>\n\n</div>', '', -25200, 1442601851, 0, '', ''),
(52, 'flight_tickets_booking', 'en', 49, 'Flight Tickets Booking', '', '/uploads/14202538631466.jpeg', '<p>Booking China flights? We recommend you Ctrip. It goes the extra mile to bring you the best China flight deals around by working closely with all major domestic Chinese and international airlines to offer optimal fares based on the latest real-time data.</p>\n\n<div class="article">\n\n    <dl class="business-trip-service">\n\n <li>\n                <img width="280" height="180" alt="" src="/uploads/14202538631466.jpeg">\n <br> <br> <br>\n<a href=" http://english.ctrip.com/" target="_blank">Flight Ticket Booking</a>\n </li>\n\n   </dl>\n\n</div>', '', -25200, 1442601910, 0, '', ''),
