(54, 'po_request', 'en', 46, 'PO Request', '', '/uploads/142019016151692.jpg', '<div class="customer-request">\n<h2>Purchase Order Request Sheet</h2>\n<form id="sampleRequestForm" class="form-horizontal" role="form">\n<div class="form-group clearfix"><label class="control-label" for="Name">Name： </label>\n<div class="float-l"><input class="form-control" name="name"> </div></div>\n<div class="form-group clearfix"><label class="control-label" for="Date">Date： </label>\n<div class="float-l"><input class="form-control" name="date"> </div></div>\n<div class="form-group clearfix"><label class="control-label" for="No">NO： </label>\n<div class="float-l"><input class="form-control" name="no"> </div></div>\n<div class="form-group clearfix"><label class="control-label" for="PO">PO #： </label>\n<div class="float-l"><input class="form-control" name="po"> </div></div>\n<div class="form-group clearfix"><label class="control-label" for="P-N">P/N： </label>\n<div class="float-l"><input class="form-control" name="pn"> </div></div>\n<div class="form-group clearfix"><label class="control-label" for="Descriptions">Descriptions： </label>\n<div class="float-l"><input class="form-control" name="desc"> </div></div>\n<div class="form-group clearfix"><label class="control-label" for="Qty">Qty： </label>\n<div class="float-l"><input class="form-control" name="qty"> </div></div>\n<div class="form-group clearfix"><label class="control-label" for="Price">Price： </label>\n<div class="float-l"><input class="form-control" name="price"> </div></div>\n<div class="form-group clearfix"><label class="control-label" for="Delivery-date">Delivery date： </label>\n<div class="float-l"><input class="form-control" name="delivery_date"> </div></div>\n<div class="form-group clearfix"><label class="control-label" for="Remarks">Remarks： </label>\n<div class="float-l"><input class="form-control" name="remarks"> </div></div>\n<div class="form-group clearfix"><label class="control-label" for="Email ">Email ： </label>\n<div class="float-l"><input class="form-control" name="email"> </div></div>\n<div class="form-group clearfix"><button class="btn btn-default" type="submit">Submit Enquiry</button> </div></form></div>', '142019016151692.jpg', 1421769600, 1442601202, 0, '', ''),
(55, 'sample_request', 'en', 46, 'Sample Request', '', '/uploads/142019016024762.jpg', '<div class="customer-request">\n<h2>Sample Request Sheet</h2>\n<form id="poRequestForm" class="form-horizontal" role="form">\n<div class="form-group clearfix"><label class="control-label" for="Name">Name：</label> \n<div class="float-l"><input class="form-control" name="name"> </div></div>\n<div class="form-group clearfix"><label class="control-label" for="Date">Date：</label> \n<div class="float-l"><input class="form-control" name="date"> </div></div>\n<div class="form-group clearfix"><label class="control-label" for="No">NO.：</label> \n<div class="float-l"><input class="form-control" name="no"> </div></div>\n<div class="form-group clearfix"><label class="control-label" for="P-N">P/N：</label> \n<div class="float-l"><input class="form-control" name="pn"> </div></div>\n<div class="form-group clearfix"><label class="control-label" for="Descriptions">Descriptions：</label> \n<div class="float-l"><input class="form-control" name="desc"> </div></div>\n<div class="form-group clearfix"><label class="control-label" for="Qty">Qty：</label> \n<div class="float-l"><input class="form-control" name="qty"> </div></div>\n<div class="form-group clearfix"><label class="control-label" for="Delivery-date">Delivery date：</label> \n<div class="float-l"><input class="form-control" name="delivery_date"> </div></div>\n<div class="form-group clearfix"><label class="control-label" for="Remarks">Remarks：</label> \n<div class="float-l"><input class="form-control" name="remarks"> </div></div>\n<div class="form-group clearfix"><label class="control-label" for="Email ">Email ：</label> \n<div class="float-l"><input class="form-control" name="email"> </div></div>\n<div class="form-group clearfix"><button class="btn btn-default" type="submit">Submit Enquiry</button> </div></form></div>', '142019016024762.jpg', 1421856000, 1442601180, 0, '', ''),
(56, 'transportation_charges', 'en', 46, 'Transportation Charges', '', '/uploads/14201901602764.jpg', '<div class="products-releases">\n    <h2>International Transportation Charges </h2>\n\n    <p>\nWhen importing goods from other countries, transportation charges always take a large part of role in the total importing costs. <br><br>\n\nGenerally speaking, international transportation methods include express, air or sea. There are four international express agencies -- DHL/UPS/FedEX/TNT. Based on our product weight, if gross weight is no more than 80KG, express economy service charge is more competitive than by air or by sea.<br><br>\n\nIn order to help our customers save more transportation cost, we provide an International Transportation Charges List for your reference, which is calculated based on international express and destination duties/taxes paid by receiver. <br><br>\n\nFor more details, please click the button and download PDF file. Thanks.\n\n    </p><div class="a-jump">\n        \n        <a title="DOWNLOAD" href="http://thsl.zenho.net/uploads/14309115278453.pdf" target="_blank">\n            <img src="../assets/images/news/a-jump_05.jpg" alt="DOWNLOAD">\n        </a>\n    </div>\n\n</div>', '', 1421596800, 1442601226, 0, '', ''),
