(58, 'technical_information', 'en', 47, 'Technical Information', '', '/uploads/14202529811166.jpg', '<p>Technical information includes connector introduction, IP code (International Protection Rating and American Wire Gauges</p>\n\n<p></p><div class="products-technology">\n    <ul>\n       <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="http://thsl.zenho.net/uploads/14298744315131.jpg" target="_blank">\n                <i>*</i>P07 Connector Introduction\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="http://thsl.zenho.net/uploads/14298744319656.jpg" target="_blank">\n                <i>*</i>P08 IP code (International Protection Rating-1\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="http://thsl.zenho.net/uploads/14298744333885.jpg" target="_blank">\n                <i>*</i>P09 IP code (International Protection Rating-1\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="http://thsl.zenho.net/uploads/14298744324953.jpg" target="_blank">\n                <i>*</i>P10 American Wire Gauges &amp; VDE Wire Gauge\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="http://thsl.zenho.net/uploads/14298744321932.jpg" target="_blank">\n                <i>*</i>P11 Finecables Standard Wire/Cables Overview\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  \n    </ul>\n</div>', '', 142021