(59, 'assembly_instructions', 'en', 47, 'Assembly Instructions', '', '/uploads/14202529815836.jpeg', '<p>Assembly instructions show how to make Layout &amp; Panel Cut-out for panel mount connectors and Field Wirable Assembly Guidelines.</p>\n\n<p></p><div class="products-technology">\n    <ul>\n       <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="http://thsl.zenho.net/uploads/14309125159732.jpg" target="_blank">\n                <i>*</i>P72 M8 PCB layout &amp; panel cut-out-1\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="http://thsl.zenho.net/uploads/14309125165964.jpg" target="_blank">\n                <i>*</i>P73 M8 PCB layout &amp; panel cut-out-2\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="http://thsl.zenho.net/uploads/14309126623668.jpg" target="_blank">\n                <i>*</i>P206 M12 Male Wirable Assembly Instruction \n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="http://thsl.zenho.net/uploads/14309126632734.jpg" target="_blank">\n                <i>*</i>P207 M12 Female Wirable Assembly Instruction\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="http://thsl.zenho.net/uploads/14309126627185.jpg" target="_blank">\n                <i>*</i>P208 M12 Field Wriable Assembly with Screw Joint\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n   <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="http://thsl.zenho.net/uploads/14309126637522.jpg" target="_blank">\n                <i>*</i>P209 M12 Field Wirable Assembly with Screw Joint,Shield\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="http://thsl.zenho.net/uploads/14309126637723.jpg" target="_blank">\n                <i>*</i>P210 M12 PCB Layout&amp;Panel cut-out\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="http://thsl.zenho.net/uploads/14309126635624.jpg" target="_blank">\n                <i>*</i>P211 M12 FCB Layout&amp;Panel cut-out\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="http://thsl.zenho.net/uploads/14309130143625.jpg" target="_blank">\n                <i>*</i>P260 Mini-change 7/8" Assembly Instruction\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="http://thsl.zenho.net/uploads/14309130150901.jpg" target="_blank">\n                <i>*</i>P261 Mini-change 7/8" PCB Layout&amp;Panel Cut-out\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n   <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="http://thsl.zenho.net/uploads/14309130157029.jpg" target="_blank">\n                <i>*</i>P272 M23 Signal Connectors&amp;Assembly Instructions\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="http://thsl.zenho.net/uploads/14309130165919.jpg" target="_blank">\n                <i>*</i>P273 M23 Signal Connectors&amp;Assembly Instructions\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="http://thsl.zenho.net/uploads/14309130158933.jpg" target="_blank">\n                <i>*</i>P274 M23 Signal Connectors&amp;Assembly Instructions\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="http://thsl.zenho.net/uploads/14309130160651.jpg" target="_blank">\n                <i>*</i>P275 M23 Signal Connectors&amp;Assembly Instructions-Angled\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  \n    </ul>\n</div>', '', 1420214400, 1442601343, 0, '', ''),
(60, 'applications', 'en', 47, 'Applications', '此处无须编辑', '/uploads/disney.jpg', '\n<p>Finecables truly understands the cost, time and quality associated with the installation and integration design. Our customized solutions and one-stop services will help you reach your objective by reducing the installation time of cables and wires by 30% to 80%, BOM and design/field assembly labor costs for numerous application fields as below.</p>\n<div class="article artSty">\n    <h2>1. Sensor &amp; Industrial Automation Control</h2>\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312654650585.jpg">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312654633878.jpg">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312654640834.JPG">   \n<br><br>\n<p>Industrial Automation plays an increasingly important role in the global economy. Not only does automation increase productivity and reduce cost, it also improves the quality and consistency of products being produced. Finecables’ sensors/ actuators in the form of connectors, cable harness assemblies are perfectly suited for industrial equipment and machinery.  They offer safety in harsh environmental conditions including corrosion, shock vibration, dust, moisture buildup as well as extremely adverse installation situations. The solutions act as a control system providing reliable connections in the key industrial machinery and factory automation markets. \n    </p>\n</div>\n\n<div class="article artSty">\n    <h2>2. Telecommunications &amp; Network</h2>\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312655463657.jpg">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312655491201.jpg">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312655462220.jpg">   \n<br><br>\n<p>Telecommunications &amp; Network take a big role in people’s life and communications. This system is a collection of terminal nodes, links and any intermediate nodes which are connected so as to enable data transmission between the terminals or technical facilities. Finecables offers high-performance and reliable connector solutions for transmission systems, basis stations, data and network servers, routers, monitors etc, like USB/RJ45/DIN connectors/D-sub/UHF.\n    </p>\n</div>\n<div class="article artSty">\n    <h2>3. HVAC &amp; Refrigeration</h2>\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312655962117.jpg">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312655955654.jpg">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312655958431.jpg">   \n<br><br>\n<p>Working in the Heating Ventilation Air Conditioning (HVAC) Refrigeration &amp; Facilities industry involves maintaining a safe and accessible workplace. HVAC system design is a sub-discipline of mechanical engineering, based on the principles of thermodynamics, fluid mechanics, and heat transfer.  Finecables offers such Temperature sensors as NTC, PT100, PT200, PT1000 sensors for HVAC applications.\n    </p>\n</div>\n<div class="article artSty">\n    <h2>4. LED &amp; Lighting</h2>\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312656614518.jpg">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312656513247.jpg">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312656483405.jpg">   \n<br><br>\n<p>The high efficiency and directional nature of LEDs makes them ideal for many industrial uses. LEDs are increasingly common in stage lighting, LED display, street lights, parking garage lighting, and walkway and other outdoor area lighting, refrigerated case lighting and so on. Finecables’ circular connectors (M8/M12 Series) are widely used in LED lighting application fields.\n    </p>\n</div>\n<div class="article artSty">\n    <h2>5.  Railway Transportation System</h2>\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312657993825.jpg">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312657998512.jpg">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312657996551.jpg">   \n<br><br>\n<p>Finecables understands that, in order to effectively operate a safe and efficient rail transport network, there are some challenges have to be addressed, such as information technology coming into the train, with a very high bandwidth requirement, intended to be used in Passenger Information Systems, Video Surveillance applications, as well as internet access to address increasing demand for travelling comfort.\n    </p>\n</div>\n<div class="article artSty">\n    <h2>6. Marine &amp; Ships Engineering </h2>\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312669314896.jpg">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312669311426.jpg">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312669305372.jpg">   \n<br><br>\n<p>Marine &amp; Ships Engineering fields involves boats, yachts, ferries, cruises, radar, navigation GPS, autopilot… Meanwhile, waterproof and anti-corrosion characteristics are required for related devices and equipments, especially connectors.  Finecables’ plastic screw/snap-in/quick-lock locking systems not only can solve your worries for waterproof and anti-corrosion performance, but most importantly helps you reduce cost and save dramatically your installation time and labor cost. \n    </p>\n</div>\n<div class="article artSty">\n    <h2>7. Medical Devices</h2>\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312666112762.jpg">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312666110287.jpg">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312666109270.jpg">   \n<br><br>\n<p>Finecables provides various connectors and cable/wire harness for medical diagnostic devices. Those products not only comply with signal transmission and high voltage contacts, electrical and mechanics requirements, but also with special demands as to quality and reliability, most of which are used in computer tomography equipment, mobility aids, lifting solutions, healthcare electrical beds, convertible chairs, and wheelchair controller.\n    </p>\n</div>\n<div class="article artSty">\n    <h2>8. Renewable Energy</h2>\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312666325281.jpg">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312666314312.jpg">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312666315889.jpg">   \n<br><br>\n<p>Keeping up with renewable energy technology developing, Finecables’ power, signal, or hybrid connectors and cable assemblies are designed to work in any condition and adhere to the strictest international requirements, such as  wind power stations, wind turbines, solar power plants, inverters, and gas and hydro power plants – making installation easy, fast and reliable. Highly customized value-added solutions are available for your special requirements.\n    </p>\n</div>\n<div class="article artSty">\n    <h2>9. Measuring &amp; Testing </h2>\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312666427549.jpg">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312666423557.jpg">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312666424702.jpg">   \n<br><br>\n<p>In measurement and testing technology, precision is everything. For reliable tests and conclusive results, high quality measuring devices and procedures are needed – along with powerful connections in order to guarantee the precise transfer of measurement data at all times. The requirements for the interfaces between the test piece, measuring device and evaluation unit are enormously high. And this is exactly the reason that well-known manufacturers consistently choose Finecables. Our connectivity products are serving in airport weighing, supermarket weighing, testing monitoring system, etc.\n    </p>\n</div>\n<div class="article artSty">\n    <h2>10. Package conveyor and logistics system</h2>\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312666515577.jpg">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312666527580.jpg">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14312666514619.jpg">   \n<br><br>\n<p>Today''s supply chains demand end to end visibility and real time tracking. Efficient sorting, packaging and logistics are essential when handling large volumes of parcels from the end of the assembly line to the deployment by the end-user. Data capture solutions, fixed and handheld scanners, weighing and barcode reading systems provide accurate parcel information that ensures efficient sorting, package conveyor. Additionally, automation today stretches right up to the top shelf of a high-bay warehouse. The connection solution from Finecables enables high performance, reliability and cost effectiveness. With our wide range of high-quality cable and connectors, combined with qualified service and support, we are the reliable, long-term partner for your applications and plant design in package conveyor logistic system. \n    </p>\n</div>', '', -25200, 1442601369, 0, '', ''),
