(142, 'm8_hexagonal_screw-nut_upgraded', 'en', 42, 'M8 Hexagonal Screw-Nut Upgraded', '\nWe are glad to inform you that our M8 connector has been upgraded into hexagonal screw/nut.', '/uploads/M8-hexagonal-screw.gif', '<div class="products-releases">\n    <h2>M8 Hexagonal Screw-Nut Upgraded </h2>\n    <small>March 14th, 2015</small>\n    <p>\n        <img src="http://thsl.zenho.net/uploads/14287566482237.jpg\n" width="450" height="318">\n    </p>\n\n    <p>\n        Dear Sir/Madam,<br><br>\nWe are glad to inform you that our M8 connector has been upgraded into hexagonal screw/nut.\nThe upgraded screw/nut makes its installment more conveniently.<br><br>\nPlease kindly be noted that we will apply to the M8 connector with hexagonal screw/nut\nimmediately for any new projects or orders. Please find the improvement details on below\nseparate pages.<br><br>\nThanks and have a great day.<br><br>\nBest Regards,<br>\nDongguan Finecables Co., Ltd\n    </p>\n\n    <div class="a-jump">\n        \n        <a title="DOWNLOAD" href="/uploads/M8_Hexagonal_Screw-Nut_Upgraded.pdf" target="_blank">\n            <img src="../assets/images/news/a-jump_05.jpg" alt="DOWNLOAD">\n        </a>\n    </div>\n\n</div>', 'M8-hexagonal-screw.gif', 1426262400, 1442632969, 1, '', ''),
