(1955, 'faq', 'cn', 245, '常见问题', '', '', '<div class="article header-bg-gray">\n    <p>\n 如果您想给我们提出宝贵建议，或想咨询任何关于我们的产品与服务，请在下方输入窗口填写您的联系资料与编辑您的留言内容，感谢您的支持！我们将两个工作日内反馈给您。\n    </p>\n  \n</div>\n\n<div class="article addrList">\n    <h2>期待您的邮件或来电！</h2>\n    <h3>东莞市协顺电子科技有限公司</h3>\n    <ul class="list_5">\n        <li>\n            <i class="icon-phone"></i>电话：+86-0769-8519 1366        </li>\n        <li>\n            <i class="icon-file-text"></i>传真：+86-0769-8504 5467\n        </li>\n        <li>\n            <i class="icon-envelope"></i>邮箱：info@finecables.com\n        </li>\n    </ul>\n</div>\n\n<div class="faq">\n    <form class="form-horizontal" id="faqsForm" role="form">\n        <div class="form-group clearfix">\n            <label class="control-label" for="name">姓名：</label>\n            <div class="fl">\n                <input name="name" class="form-control" type="text">\n            </div>\n        </div>\n        <div class="form-group  clearfix">\n            <label class="control-label" for="job">职务：</label>\n            <div class="fl">\n                <input name="job_title" class="form-control" type="text">\n            </div>\n        </div>\n        <div class="form-group  clearfix">\n            <label class="control-label" for="company">公司：</label>\n            <div class="fl">\n                <input name="company" class="form-control" type="text">\n            </div>\n        </div>\n        <div class="form-group  clearfix">\n            <label class="control-label" for="tel">电话：</label>\n            <div class="fl">\n                <input name="tel" class="form-control" type="text">\n            </div>\n        </div>\n        <div class="form-group  clearfix">\n            <label class="control-label" for="email">邮箱：</label>\n            <div class="fl">\n                <input name="email" class="form-control" type="text">\n            </div>\n        </div>\n        <div class="form-group  clearfix">\n            <label class="control-label" for="questions">咨询问题：</label>\n            <div class="fl">\n                <textarea name="question" class="form-control questions" rows="3"></textarea>\n            </div>\n        </div>\n        <div class="form-group">\n            <button class="btn btn-default" type="submit">\n                提交\n            </button>\n        </div>\n    </form>\n\n</div>', '', 1434038400, 1442633775, 0, '', ''),
(1956, 'legal', 'cn', 245, '法律声明', '', '', '					<!--文章-->\n					<div class="legal-article">\n						<h5>法律声明</h5>\n						<p>\n\n版权--所有本网站的内容（文字，图片，LOGO，创意和视频）是finecables.com的财产，受中国及国际版权法的保护。本网站上的所有内容的汇编（收集，组合和重组）是finecables.com的专有财产，也受到中国和国际版权法的保护。本网站所使用的所有软件是finecables.com和软件供应商的财产，受中国及国际版权法的保护。本网站上的内容和软件可以用作信息源进行在线交易和拍卖的目的。禁止未经允许，擅自使用本网站的资料，包括复制，修改，分发，传递，再版，展示。\n\n\n						</p><br>\n						<p>\n商标--图形，图片，图表，音频，原创性，标志及服务名称，finecables.com图标相关法律的保护。这些商标，适当的名称，图标，不能使用上是不属于这个部位和任何产品或服务可能导致客户混淆或歧义。禁止任何使用的商标，专有名称，图标，歪曲或诋毁任何形式的网站。\n						</p>\n<p>\n网站引用 - 本网站或本网站的任何部分不能被复制，复印，复制，出售，转售或用于非finecables.com明确许可的商业目的。如果任何客户的行为被定义为或对损害本网站相关权益，finecables.com及其下属公司保留相关权利，如，包括但权利不限兴趣，拒绝提供服务，阻止改用户的帐户， /或取消订单。\n\n						</p><br>\n<p>\n\n意见-- finecables.com鼓励网页访客留下他们的意见。同时表明您授权本网站和其关联企业引述您的意见，并在必要时，您的评论可能会被封闭。\n						</p><br>\n<p>\n链接 - 服务链接可以访问其他网站，这些网站都没有在finecables.com的控制权。本网站不负责对链接到本网站的任何其它网站的内容。\n						</p><br>\n<p>\n适用法律-- finecables.com属于东莞市协顺电子科技有限公司所有。如上条款和条件上文适用于中华人民共和国的法律。我们保留修改网站条款的权利，恕不另行通知。\n						</p>\n					</div>', '', 1433952000, 1442633806, 0, '', ''),
(1957, 'contact_finecables', 'cn', 246, '公司简介', '', '', '<div class="article line01">\r\n    <h2>关于协顺 &nbsp;Tom</h2>\r\n    <img width="167" height="140" class="box3_img" src="http://thsl.zenho.net/uploads/14277029817026.jpeg">\r\n    <p>\r\n东莞市协顺电子科技有限公司(简称“协顺 Finecables” )，成立于2003年，致力于成为世界领先的连接产品制造商。公司始终坚持以顾客为中心，凭借丰富的行业经验，努力为客户提供优质的产品、创新的终端解决方案以及一流的技术和服务。其产品领域应用广泛，不但包括了工业防水连接器，也涉及到网络互联和数据传输等相关电子连接产品。我们善于根据客户的实际需求快速反馈，创造性地提供设计方案，成为客户一站式OEM/ODM需求采购的终端供应商。“遵守约定，不讲借口；马上行动，积极反馈；实事求是，追求绩效”，构成了我们协顺的服务精神。\r\n\r\n    </p>\r\n\r\n    <ul class="list_4">\r\n    </ul>\r\n</div>\r\n<div class="article">\r\n    <h2>产品</h2>\r\n    <img width="170" height="140" class="box3_img" src="http://thsl.zenho.net/uploads/14277038495430.jpeg">\r\n    <p>\r\n<br>\r\n<br>\r\n作为集设计、制造、销售与服务为一体的专业线束连接产品与工业连接器制造商，协顺根据客户需求，坚持创新，不断开发新产品，为广大客户提供如下产品：\r\n    </p>\r\n<br><br>\r\n\r\n <ul class="list_4 list_4_1">\r\n        <li>\r\n            圆形连接器 (应用于工业领域) : M5、M8、M10、M12、M16、M20、7/8"、M23、RD24\r\n        </li>\r\n        <li>\r\n           电磁阀 (应用于液压、气压传动及电磁阀开关): A、B、C 型电磁阀\r\n        </li>\r\n        <li>\r\n            数据输入/输出连接器(数据传输网络): USB、RJ45、Mini-Din、D-SUB、UHF、HDMI\r\n        </li>\r\n        <li>\r\n ISO-BUS和分线盒连接器: M8/M12分线盒4、6、8位，带7/8"、M23连接头)，用于现场总线领域。\r\n        </li>\r\n <li>\r\n         温度传感器和线束组件\r\n        </li>\r\n <li>\r\n    客户定制化解决方案\r\n        </li>\r\n    \r\n</ul></div>\r\n\r\n<div class="article">\r\n    <h2>研发</h2>\r\n    <img width="167" height="140" class="box3_img" src="http://thsl.zenho.net/uploads/14277016630315.gif">\r\n    <p>\r\n协顺的研发团队基于多年来在连接器领域丰富的行业经验和深厚的技术沉淀，以充足的产能和模具设计制造能力为支持配合，根据客户实际产品应用，不断开发设计新产品，满足客户的定制化需求。\r\n    </p>\r\n<br>\r\n<br>\r\n<br>\r\n    <p>\r\n协顺始终坚持“快速、超越、危机、感恩”的核心价值观，坚持与客户和供应商建立长期合作、互惠互利、双赢的合作伙伴关系，用实践诠释公司的经营理念——“用激情连接世界”！\r\n    </p>\r\n</div>', '', 1434319200, 1449110263, 0, '', '');
INSERT INTO `articles` (`id`, `code`, `lang`, `type_id`, `name`, `desc`, `cover`, `content`, `download`, `ctime`, `mtime`, `is_hot`, `keywords`, `picture_gallery`) VALUES
(1958, 'history', 'cn', 246, '历史', '', '', '<div class="article">\n    <p class="intro">\n       以时间为坐标的x轴，以技术创新为y轴,，协顺呈现一幅开拓进取，不断进步的里程篇章。虽然年轻，但我们充满激情，斗志昂扬。\n    </p>\n<br>\n    <h2>Finecables Milestones</h2>\n    <div class="dl_list2">\n        <dl>\n<dt>\n                2014\n            </dt>\n            <dd>\n                11月---协顺美国分公司成立于西雅图\n            </dd>\n            <dd>\n                10月---成为美国NMEA（国际海洋电气协会）会员\n            </dd>\n            <dd>\n               09月---华北办事处成立于河北石家庄\n            </dd>\n<dd>\n           06月---日本办事处成立于日本东京 \n            </dd>\n        </dl>\n        <dl>\n            <dt>\n            </dt><dt>\n                2013\n            </dt>\n            <dd>\n                10月---获得TÜV SÜD颁发的ISO 14001：2004环境管理体系认证\n            </dd>\n            <dd>\n                08月--- “感恩有你！”协顺成立“十周年”庆典活动\n            </dd>\n        </dl>\n        <dl>\n            <dt>\n                2012\n            </dt>\n            <dd>\n                03月---50+款M12传感器连接器获得美国UL\n            </dd>\n            <dd>\n               02月---M23系列产品获得CE认证\n            </dd>\n        </dl>\n        <dl>\n            <dt>\n                2011\n            </dt>\n            <dd>\n               10月---华东办事处在苏州工业园区成立\n            </dd>\n            \n        </dl>\n        <dl>\n            \n            <dt>\n                2009\n            </dt>\n            <dd>\n              07月---欧洲客户服务中心于英国东萨塞克斯郡(EAST SUSSEX)成立\n            </dd>\n        </dl>\n        <dl>\n            <dt>\n                2008\n            </dt>\n            <dd>\n               06月---M12传感器圆形连接器产品获得UL认证 \n            </dd>\n\n        </dl>\n        <dl>\n            <dt>\n                2007\n            </dt>\n            <dd>\n                06月---M12、M8传感器圆形连接器系列产品获得CE认证\n            </dd>\n            <dd>\n                03月---线束产品获得美国UL认证\n            </dd>\n        </dl>\n        <dl>\n            <dt>\n                2005\n            </dt>\n            <dd>\n                05月---工厂搬迁至东莞市虎门镇\n            </dd>\n            <dd>\n               04月---获得TÜV SÜD颁发的ISO 9001:2000质量管理体系认证\n            </dd>\n           \n\n        </dl>\n       \n        <dl>\n            <dt>\n                2003\n            </dt>\n            <dd>\n              08月---公司创立于深圳市南山区 \n            </dd>\n           \n        </dl>\n    </div>\n</div>', '', 1434124800, 1442633912, 0, '', ''),
(1959, 'contact_finecables', 'cn', 245, '联系协顺', 'FFFFFFFFFFFFFFFFFFFFFFFFFFFFFF', '', '					<div class="article header-bg-gray">\n						<p>\n							协顺认真倾听来自客户的每一个要求与建议，也珍惜每一次商业合作机会。如果您想给我们提出建议，或了解、咨询任何关于我们的产品与服务，请参考以下联系方式：\n						</p>\n					</div>\n\n					<div class="article addrList">\n						<img src="../assets/images/map_01.jpg" width="200" height="150">\n						<ul class="list_5">\n							<li class="h2">\n								中国总部(华南工厂）\n							</li>\n							<li class="h3">\n								东莞市协顺电子科技有限公司\n							</li>\n							<li>\n								<i class="icon-phone"></i>电话: +86-(0)769-8519 1366\n							</li>\n							<li>\n								<i class="icon-file-text"></i>传真: +86-(0)769-8504 5467\n							</li>\n							<li>\n								<i class="icon-envelope"></i>邮箱:  info@finecables.com\n							</li>\n							<li>\n								<i class="icon-location-arrow"></i>地址：广东省东莞市虎门镇威远岛南面工业区B5栋.邮编：523900.\n							</li>\n						</ul>\n					</div>\n					<div class="article addrList clearfix">\n						<img width="200" src="/uploads/14202561425727.jpeg" height="150">\n						<ul class="list_5">\n							<li class="h2">\n								华东区\n							</li>\n							<li class="h3">\n								苏州办事处\n							</li>\n							<li>\n								<i class="icon-user"></i>Mr.熊鲲鹏\n							</li>\n							<li>\n								<i class="icon-phone"></i>电话：+86-(0)512--62386983\n							</li>\n							<li>\n								<i class="icon-mobile-phone"></i>手机: +86-(0)136 2528 9019\n							</li>\n							<li>\n								<i class="icon-envelope"></i>邮箱:  tony@finecables.com\n							</li>\n							<li>\n								<i class="icon-location-arrow"></i>地址：中国苏州工业园区雅戈尔太阳城2栋1404室（沙湖生态公园旁）（邮编：215027）\n							</li>\n						</ul>\n					</div>\n					<div class="article addrList clearfix">\n						<img src="/uploads/14202561006456.jpeg" width="200" height="150">\n						<ul class="list_5">\n							<li class="h2">\n								华北区\n							</li>\n							<li class="h3">\n								石家庄办事处\n							</li>\n							<li>\n								<i class="icon-user"></i>Mr.刘坎松\n							</li>\n							<li>\n								<i class="icon-phone"></