(1960, 'm12_shielded_connector_upgraded', 'cn', 249, 'M12 防护连接品升级', '升级版的M12全屏蔽产品更美观。其六角螺丝/螺母极大地节约了安装时间。', '/uploads/-1667736773.gif', '<div class="products-releases">\n    <h2>M12全屏蔽连接器升级</h2>\n    <small>March 16th, 2015</small>\n    <p>\n        <img width="450" height="318" src="http://thsl.zenho.net/uploads/14287587188447.jpg">\n    <img width="450" height="318" src="http://thsl.zenho.net/uploads/14287587181524.jpg">\n    </p>\n\n    <p>\n        尊敬的客户：<br><br>\n告诉您一个好消息。我们的M12公、母头注塑成型式全屏蔽产品优化升级了--外形设计更加美观和工作性能更加优良。新的六角螺丝、螺母可用组装工具快速装配，大大提升了安装时间和劳动成本。\n\n<br><br>\n新升级的M12屏蔽注塑成型式产品将用于新项目和新订单。请知悉。想了解产品升级的详情，请下载查阅。<br><br>\n\n工作愉快。谢谢。<br><br>\n\n顺祝商祺，<br>\n协顺科技\n    </p>\n\n    <div class="a-jump gw_btn">\n        <a class="collect" title="Download" href="/uploads/M12_Shielded_Connector_Upgraded-Finecables.pdf" target="_blank">\n            下载\n        </a>\n    </div>\n\n</div>', '', 1434297600, 1442634075, 1, '', ''),
(1961, 'spring_festival_2015', 'cn', 250, '2015春节晚会', '2015年2月13号<br>\r\n协顺全体职工家属欢聚一堂，欢歌载舞，共祝新年。', '/uploads/-1582554429.gif', '<div class="company_news_leve">\r\n    <h2>2015 协顺春节晚会</h2>\r\n<br>   <small>2015年2月13号</small><br><br>\r\n\r\n        <img width="150" alt="" src="http://thsl.zenho.net/uploads/14284974181022.gif">\r\n\r\n        <img width="150" alt="" src="http://thsl.zenho.net/uploads/14284974206034.gif">\r\n\r\n        <img width="150" alt="" src="http://thsl.zenho.net/uploads/14284974197014.gif"><br>\r\n  <p>\r\n新春临近，协顺人欢聚一堂。欢歌载舞，共祝新年。节目丰富多彩：舞蹈、歌曲、相声、小品、抽奖、话剧等等。在协顺人自己的春晚舞台上，大家尽情欢唱，把激情与喜悦，带给新的一年。\r\n    </p>\r\n\r\n</div>', '', 1434319200, 1442543087, 1, '', ''),
(1962, 'nmea_expo_2015', 'cn', 251, 'NMEA Expo 博览会', '9.29~10.1, 2015<br>\n展位号: 306<br>\n地点：美国马里兰州巴尔的摩市喜来登酒店。<br> \n真诚期待您的到来！\n', '/uploads/14407153991041.jpg', '<div class="exhibitions-detail">\n    <h2>2015 临近展会</h2>\n<br>\n    <small>2015 NMEA Expo 海洋电气协会博览会</small><br>\n\n\n<div class="clearfix dl-list">\n    \n    <img width="200" height="100" class="box3_img" alt="展会命名" src="/uploads/1.44071607386E+13.jpg">\n    <p>\n日期: 9.29~10.1,2015<br>\n展位号: 306<br>\n地点：美国马里兰州巴尔的摩市喜来登酒店。<br>\n展会网址: www.expo.nmea.org\n\n    </p>\n<br><br>\n<p>展会简介: NMEA 研讨会&amp;博览会，每年度举行一次，为广大经销商、制造商以及海洋电子业务网络商提供了现场面对面的培训、交流的平台，促进业务增长。\n\n<br><br>我们真诚期待您的到来！\n</p>\n    <ul class="list_4">\n    </ul>\n</div>    \n</div>', '14407153991059.jpg', 1434297600, 1442634148, 1, '', ''),
