       <div class="form-group clearfix">\n                <button class="btn btn-default" type="submit">\n                    提交\n                </button>\n            </div>\n\n            <div class="form-group clearfix">\n                <a class="float-l" href="/supports_services/article?id=63">\n                    了解更多协顺新闻专题，请点击\n                </a>\n            </div>\n        </form>\n    </div>\n\n</div>', '', 1434297600, 1440292318, 0, '', ''),
(1976, 'corporate_culture', 'cn', 246, '企业文化', '', '', '<div class="article artSty">\r\n    <p class="intro">\r\n       "用激情连接世界！”它充分诠释了协顺的企业文化。协顺以极大的热情致力于连接器行业，努力与客户和供应商建立长期友好双赢的伙伴关系。总而言之，我们就是你们的最佳合作伙伴！\r\n    </p>\r\n   <img width="500" height="281" src="http://thsl.zenho.net/uploads/14295344783702.jpg">\r\n<br><br>\r\n    <h2>我们的理念</h2>\r\n    <ul class="list_4 list_4_1">\r\n        <li>\r\n            愿景：成为世界领先的连接产品制造商。\r\n        </li>\r\n        <li>\r\n            使命：以客户为中心，贡献富有创造力的可靠的连接器产品及其解决方案，并提供一流的技术和服务，实现持续改进和共同发展。\r\n        </li>\r\n        <li>\r\n            经营方针：独立自主，创新发展，信任伙伴。\r\n        </li>\r\n        <li>\r\n            核心价值观：快速，超越，危机，感恩。\r\n        </li>\r\n        <li>\r\n           协顺精神：遵守约定，不讲借口，马上行动，积极反馈，事实求是，推求绩效。\r\n        </li>\r\n    </ul>\r\n</div>\r\n<div class="article artSty">\r\n    <h2>以客户为中心战略</h2>\r\n\r\n    <p>\r\n       服务客户是协顺存在的唯一理由，客户的需求是我们发展的根本驱动力。\r\n    </p>\r\n    <ul class="list_4 list_4_1">\r\n        <li>\r\n           高品质、优服务、低运营成本、优先满足客户需求，提升客户的市场竞争力和赢利能力。\r\n        </li>\r\n        <li>\r\n          不断提高管理水平，以实现确保优质高效的流程化运作。\r\n        </li>\r\n        <li>\r\n         与业界同行既竞争又合作，共同营造一个良性发展的行业环境，共享价值链利益。\r\n        </li>\r\n\r\n    </ul>\r\n</div>\r\n<div class="article artSty">\r\n    <h2>成本高效与快速反应</h2>\r\n\r\n    <p>\r\n       协顺了解当今激烈的市场竞争环境下，客户对项目的交付周期与成本有着严格的要求；因此，高效的运作与成本的优势已经成为推动项目外包国际化的重要因素之一。 在中国的制造成本低于欧美国家的基础上，为了达到成本的优势，协顺严格执行7S管理系统并持续改进产品制造工艺与流程；同时我们也深知在当前激烈的市场竞争环境下除成本和专业知识外， 缩短完成项目的时间、迅速的做出反应，也是在业务发展的关键。\r\n    </p>\r\n</div>', '', 1434232800, 1442543152, 0, '', ''),
(1977, 'global_distributors', 'cn', 245, '代理商', 'NA', '', '					<div class="article header-bg-gray">\r\n						<p>\r\n协顺再不同国家分布代理商合作伙伴，期待与您合作。代理商信息如下：\r\n						</p>\r\n					</div><br>\r\n\r\n					<div class="map-box">\r\n						<img alt="" src="../assets/images/contact-us/map_03.jpg">\r\n					</div>\r\n<br><br>\r\n					<div class="article addrList">\r\n						<h2>韩国\r\n						<img width="30" height="30" src="/uploads/14202576197936.png">\r\n						</h2>\r\n						<h3>Creken Co.,Ltd</h3>\r\n						<ul class="list_5">\r\n\r\n							<li>\r\n								<i class="icon-user"></i> Mr. Ken Park\r\n							</li>\r\n							<li>\r\n								<i class="icon-phone"></i>电话：070-7842-2003\r\n							</li>\r\n							\r\n							<li>\r\n								<i class="icon-envelope"></i>邮箱：ken@creken.co.kr\r\n							</li>\r\n							<li>\r\n								<i class="icon-location-arrow"></i>地址：#908 9th floor Yeong Dong Techno Tower, Seongsu-Dong 2Ga, Seongdong-Gu, Seoul, South Korea 133-120\r\n							</li>\r\n						</ul>\r\n					</div>\r\n<br><br>\r\n					<div class="article addrList">\r\n						<h2>以色列\r\n						<img width="30" height="30" src="/uploads/14202576197237.jpeg">\r\n						</h2>\r\n						<h3>Migvan Technologies &amp; Engineering Ltd</h3>\r\n						<ul class="list_5">\r\n\r\n							<li>\r\n								<i class="icon-user"></i> Mr. Ori Kaplan\r\n							</li>\r\n							<li>\r\n								<i class="icon-phone"></i>Tel：972-74-7844427\r\n							</li>\r\n							\r\n							<li>\r\n								<i class="icon-envelope"></i>邮箱：Oir@mte.com.il\r\n							</li>\r\n							<li>\r\n								<i class="icon-location-arrow"></i>地址：14 Atir Yeda St.44643-23,Kfar Saba,ISRAEL\r\n							</li>\r\n						</ul>\r\n					</div>\r\n<br><br>\r\n					<div class="article addrList">\r\n						<h2>土耳其\r\n						<img width="30" height="30" src="/uploads/14202576197105.jpeg">\r\n						</h2>\r\n						<h3>Konneksan Konnektor Otomasyon</h3>\r\n						<ul class="list_5">\r\n\r\n							<li>\r\n								<i class="icon-user"></i> Mr.Oktay BAŞ\r\n							</li>\r\n							<li>\