(1978, 'routing_directory', 'cn', 245, '地图导航', '', '', '					<!--文章-->\n					<div class="routing-directory">\n<iframe src="http://www.google.cn/maps/embed?pb=!1m18!1m12!1m3!1d3677.995948887438!2d113.641472!3d22.802614!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x3403bbbdaa886f75%3A0xf01c2339f15d7b93!2z5Lic6I6e5biC5Y2P6aG655S15a2Q56eR5oqA5pyJ6ZmQ5YWs5Y-4!5e0!3m2!1szh-CN!2scn!4v1442886714567" width="490" height="350" frameborder="0" style="border:0" allowfullscreen=""></iframe>\n						<p>\n							· 0.5 小时 / 35KM 车程到深圳机场\n						</p>\n						<p>\n							· 1.5 小时 / 100KM 车程到广州机场\n						</p>\n						<p>\n							· 2.0 小时 / 100KM 车程到香港机场\n						</p>\n					</div>\n', '', 1434124800, 1442886955, 0, '', ''),
(1979, 'quality_and_environmental_management', 'cn', 246, '质量与环境管理', '4th', '', '<div class="article artSty">\n <p class="intro">\n      企业的生命源于优秀的品质，正如人的生命基于健康的体魄；优越的性能和可靠的质量，是产品竞争力的关键。\n    </p>\n<br>\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14284076313898.gif">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14284076304709.gif">\n<img width="160" height="106" src="http://thsl.zenho.net/uploads/14295347271146.jpg">\n<br><br>\n\n    \n<div class="article artSty">\n    <h2>品质方针</h2>\n   \n    <ul class="list_4 list_4_1">\n        <li>\n            持续创新，改进技术；\n        </li>\n        <li>\n           提高效率，减少消耗；\n        </li>\n        <li>\n           客户满意，共同发展。\n        </li>\n\n    </ul>\n</div>\n<div class="article artSty">\n    <h2>品质目标</h2>\n   \n    <ul class="list_4 list_4_1">\n        <li>\n            产品出货合格率100%；\n        </li>\n        <li>\n           每月客诉不超过0件；\n        </li>\n        <li>\n           客户满意率98%以上。\n        </li>\n\n    </ul>\n</div>\n<div class="article artSty">\n    <h2>环境方针</h2>\n<ul class="list_4 list_4_1">\n        <li>\n            全员参与，持续改进；\n        </li>\n        <li>\n            符合法规，节约资源；\n        </li>\n        <li>\n           防止污染，保护环境。\n        </li>\n\n    </ul>\n</div>\n<div class="article artSty">\n    <h2>环境目标</h2>\n<ul class="list_4 list_4_1">\n        <li>\n            全年无重大环境事故；\n        </li>\n        <li>\n            能源消耗(水/电/纸)每年降低1%；\n        </li>\n        <li>\n           职工环境意识培训率100%；\n        </li>\n<li>\n           各项污染排放达到国际标准；\n        </li>\n<li>\n           废弃物分类正确率100%。\n        </li>\n\n    </ul>\n</div>\n<br>\n    <p>\n产品品质对于协顺而言，就像健康对于人们一样重要。协顺的一切工作都以产品优质的性能和值得信赖的质量为基础。公司致力于“高品质的产品”的理念，源于整个团队对品质的全面深入理解。我们开发一套严格的程序审核和质量管控流程，确保我们和我们的供应商为客户提供优质的服务和高品质的产品，并顺利荣获德国TÜV SÜD机构认证授予的ISO9001:2008质量管理体系认证和ISO14001:2004环境管理体系认证。\n    </p>\n</div>', '', 1434038400, 1442633935, 0, '', ''),
(1980, 'patents_and_certificates', 'cn', 246, '专利证书', '', '', '<div class="article artSty">\n    <h2>专利&amp;证书</h2>\n\n      <div class="patents-certificates">\n\n        <ul class="clearfix">\n            <li>\n                <img width="124" height="180" alt="" src="../assets/images/certificates/certificates_03.jpg">\n                <a href="/uploads/14407042405020.pdf" target="_blank">ISO 14001：2004</a>\n            </li>\n\n\n            <li>\n                <img width="124" height="180" alt="" src="../assets/images/certificates/certificates_03.jpg">\n<a href="/uploads/14407042882768.pdf" target="_blank">  ISO 9001：2008</a>\n            </li>\n\n     <li>\n          <img width="124" height="180" alt="" src="/uploads/14362058153727.jpg">\n<a href="/supports_services/article?id=1974" target="_blank">专利</a>\n     </li>\n\n\n     <li>\n          <img width="124" height="180" alt="" src="/uploads/14362064534635.jpg">\n<a href="/supports_services/article?id=1974" target="_blank">UL 证书</a>\n     </li>\n\n     <li>\n          <img width="124" height="180" alt="" src="/uploads/14362057917936.jpg">\n<a href="/supports_services/article?id=1974" target="_blank">CE 证书</a>\n     </li>\n\n\n     <li>\n          <img width="124" height="180" alt="" src="/uploads/14362058042329.jpg">\n<a href="/supports_services/article?id=1974" target="_blank">IP防护等级</a>\n     </li>\n\n\n           \n        </ul>\n    </div>\n</div>', '', 1433952000, 1442634002, 0, '', ''),
(1981, 'human_resources', 'cn', 246, '人力资源', '', '', '\n					<div class="article artSty">\n						\n						<h2>人才招募</h2>\n						<p>\n							培训与职业发展\n						</p>\n <ul class="list_4 list_4_1">\n        <li>\n           人才的聘用与相关决定取决于个人的能力与业绩表现\n        </li>\n        <li>\n            为员工提供一个以成效为导向的弹性作业环境\n        </li>\n        <li>\n            提倡信任、理让与互尊的工作气氛\n        </li>\n        <li>\n            珍惜与鼓励拥有特殊技能与为协顺做出贡献的人才\n        </li>\n        <li>\n           提倡终身学习，鼓励员工不断自我提升与完善\n        </li>\n<li>培养与促进公司员工有效面对不断变化发展的市场挑战</li>\n<li>通力协作，与协顺一起成长</li>\n    </ul>\n<div style="margin: 1em 0em; padding: 1em; text-align:center;background-color: #f0f8fb;">\n<p>想成为协顺一员？请点击“<a href="http://dg.job5156.com/corp/176648" target="_blank">网上招聘</a>”or 请将您的个人简历发送至：<a href="mailto: admin_wmj@finecables.com">admin_wmj@finecables.com</a></p>\n</div>\n						<h2>福利待遇</h2>\n						<p>\n							绩效与激励\n						</p>\n<ul class="list_4 list_4_1">\n        <li>\n            协顺对雇员的激励基于个人为公司与团队所作出的贡献与自身的能力，并非学历,经验,资历或头衔等因素。\n        </li>\n        <li>\n             协顺以结果为导向的绩效管理模式, 要求管理者通过为团队持续设定目标,辅导培训,评估总结和相互沟通来帮助员工提高绩效。\n        </li>\n        <li>\n           为促使员工不断的创新与自我提升，2003年协顺设立FA奖励基金，专门用来鼓励拥有专门技能并为促进公司价值的提升作出贡献的员工。\n        </li>\n    \n    </ul></div>\n\n<div class="article artSty">\n    <h2>教育培训</h2>\n<p>\n协顺致力于成为一家学习型组织， 通过专业的培训系统来持续提升员工的知识技能与绩效，促使协顺的人力资本得到增值。人力资源部门与各部门负责人员共同协调管理公司的培训工作；对新员工提供岗前入职培训，包括：企业文化、作业指导、产品知识、市场与销售、行业信息等系列针对性课程，为使每个新员工能达到上岗技能要求,培训计划将根据岗位的需求分为半月到6个月不等；在职培训方面主要包括管理和技术两个方面的提升培训。根据各职务及岗位的不同层次的需求，协顺为其雇员的职业发展提供系统发展与提升方案。\n</p>\n</div>', '', 1433865600, 1442888647, 0, 'Career tom', ''),
(1982, 'po_request', 'cn', 253, '订单申请表', '', '/uploads/-1571276232.jpg', '<div class="customer-request">\n    <h2>订单申请表</h2>\n\n    <form class="form-horizontal" id="sampleRequestForm" role="form">\n        <div class="form-group clearfix"><label class="control-label" for="Name">姓名： </label>\n\n            <div class="float-l"><input name="name" class="form-control"></div>\n        </div>\n        <div class="form-group clearfix"><label class="control-label" for="Date">日期： </label>\n\n            <div class="float-l"><input name="date" class="form-control"></div>\n        </div>\n        <div class="form-group clearfix"><label class="control-label" for="No">电话： </label>\n\n            <div class="float-l"><input name="no" class="form-control"></div>\n        </div>\n        <div class="form-group clearfix"><label class="control-label" for="PO">订单号： </label>\n\n            <div class="float-l"><input name="po" class="form-control"></div>\n        </div>\n        <div class="form-group clearfix"><label class="control-label" for="P-N">料号： </label>\n\n            <div class="float-l"><input name="pn" class="form-control"></div>\n        </div>\n        <div class="form-group clearfix"><label class="control-label" for="Descriptions">规格描述： </label>\n\n            <div class="float-l"><input name="desc" class="form-control"></div>\n        </div>\n        <div class="form-group clearfix"><label class="control-label" for="Qty">数量： </label>\n\n            <div class="float-l"><input name="qty" class="form-control"></div>\n        </div>\n        <div class="form-group clearfix"><label class="control-label" for="Price">价格： </label>\n\n            <div class="float-l"><input name="price" class="form-control"></div>\n        </div>\n        <div class="form-group clearfix"><label class="control-label" for="Delivery-date">交货日期： </label>\n\n            <div class="float-l"><input name="delivery_date" class="form-control"></div>\n        </div>\n        <div class="form-group clearfix"><label class="control-label" for="Remarks">备注： </label>\n\n            <div class="float-l"><input name="remarks" class="form-control"></div>\n        </div>\n        <div class="form-group clearfix"><label class="control-label" for="Email ">Email ： </label>\n\n            <div class="float-l"><input name="email" class="form-control"></div>\n        </div>\n        <div class="form-group clearfix">\n            <button class="btn btn-default" type="submit">提交询盘</button>\n        </div>\n    </form>\n</div>', '', 1434124800, 1442602037, 0, '', ''),
(1983, 'transportation_charges', 'cn', 253, '运输费用', '', '/uploads/-1569309933.jpg', '<div class="products-releases">\n    <h2>国际运费表 </h2>\n\n    <p>\n在进出口国际贸易中，运费通常扮演重要的角色。 <br><br>\n\n一般来说，常用的国际运输方式有国际快递、空运和海运。国际快递公司有DHL、UPS、FedEX、TNT。根据货物重量（体积小于重量），如果货物不超过80kG，经济型的快递服务比起单纯的空运和海运更加优惠。<br><br>\n\n为了帮助客户节约运费以及安排运输的冗杂流程，我们与国际快递公司长期合作，推出一份优惠的国际运费表，供大家参考比较。该费用仅包含运费，当地进口关税由收货方根据本国实情自行处理。 <br><br>\n\n了解详情，请点击如下“Download"，下载PDF文档。谢谢。\n\n    </p><div class="a-jump">\n        \n        <a title="DOWNLOAD" href="http://thsl.zenho.net/uploads/14309115278453.pdf" target="_blank">\n            <img alt="DOWNLOAD" src="../assets/images/news/a-jump_05.jpg">\n        </a>\n    </div>\n\n</div>', '', 1434038400, 1442602049, 0, '', ''),
(1984, 'applications', 'cn', 230, '应用', '', '', '<h2>应用</h2>\n<img src="/assets/images/pic_003-06.jpg">\n\n<h3><a href="/supports_services/article?id=1988">连接器应用</a></h3>\n\n<p>\n    连接器广泛应用于工业自动化、网络信号传输、LED照明、交通轨道、医疗器械、船舶海洋工程、衡器等等。</p>', '', 1434384000, 1442633665, 0, '', ''),
(1985, 'company_profile', 'cn', 230, '公司简介', '', '', '<img width="167" height="140" class="box3_img" src="http://thsl.zenho.net/uploads/14277029817026.jpeg">\n\n<div class="article">\n    <h2><a href="/about_us">关于协顺</a></h2>\n\n    <p>\n东莞市协顺电子科技有限公司(简称“协顺 Finecables” )，成立于2003年，致力于成为世界领先的连接产品制造商。公司始终坚持以顾客为中心，凭借丰富的行业经验，努力为客户提供优质的产品、创新的终端解决方案以及一流的技术和服务。其产品领域应用广泛，不但包括了工业防水连接器，也涉及到网络互联和数据传输等相关电子连接产品。我们善于根据客户的实际需求快速反馈，创造性地提供设计方案，成为客户一站式OEM/ODM需求采购的终端供应商。“遵守约定，不讲借口；马上行动，积极反馈；实事求是，追求绩效”，构成了我们协顺的服务精神。\n\n</p>\n</div>', '', 1434384000, 1442633688, 0, '', ''),
(1986, 'technical_information', 'cn', 255, '技术说明', '', '/uploads/14202529811166.jpg', '<p>技术说明包括连接器介绍、IP外壳防护等级和美国导体规格。</p>\n\n<p></p><div class="products-technology">\n    <ul>\n       <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="/uploads/1.44070116343E+13.png" target="_blank">\n                <i>*</i>P07 连接器介绍\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="/uploads/1.44070116377E+13.png" target="_blank">\n                <i>*</i>P08 IP外壳防护等级介绍-1\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="/uploads/1.4407011638E+13.png" target="_blank">\n                <i>*</i>P09 IP外壳防护等级介绍-2\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="/uploads/1.44070116482E+13.png" target="_blank">\n                <i>*</i>P10 美规&amp;欧规线材导体规格\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="http://thsl.zenho.net/uploads/14298744321932.jpg" target="_blank">\n                <i>*</i>P11 协顺常用线材一览表\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  \n    </ul>\n</div>', '', 1440432000, 1442602093, 0, '', ''),
(1987, 'assembly_instructions', 'cn', 255, '安装指南', '', '/uploads/14202529815836.jpeg', '<p>安装指南介绍了连接器的空位分布图和钻孔尺寸，面板式产品的铣刀面尺寸以及现场组装说明。</p>\n\n<p></p><div class="products-technology">\n    <ul>\n       <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="/uploads/1.44070221225E+13.png" target="_blank">\n                <i>*</i>P72 M8 PCB孔位分布&amp;钻孔尺寸\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="/uploads/1.44070221229E+13.png" target="_blank">\n                <i>*</i>P73 M8 PCB孔位分布&amp;钻孔尺寸\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="/uploads/1.44070221285E+13.png" target="_blank">\n                <i>*</i>P206 M12安装指南 \n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="/uploads/1.44070221289E+13.png" target="_blank">\n                <i>*</i>P207 M12安装指南 \n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="/uploads/1.44070221301E+13.png" target="_blank">\n                <i>*</i>P208 M12安装指南（锁端子）\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n   <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="/uploads/1.44070221288E+13.png" target="_blank">\n                <i>*</i>P209 M12安装指南（锁端子，带屏蔽）\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n          