                JPG\n            </a>\n        </li>\n  <li class="clearfix">\n            <a title="DOWNLOAD" class="fl" href="/uploads/1.44070221492E+13.png" target="_blank">\n                <i>*</i>P275 M23电源类安装指南\n            </a>\n            <a title="Download" class="fr" href="#">\n                JPG\n            </a>\n        </li>\n  \n    </ul>\n</div>', '', 1434556800, 1442602107, 0, '', '');
INSERT INTO `articles` (`id`, `code`, `lang`, `type_id`, `name`, `desc`, `cover`, `content`, `download`, `ctime`, `mtime`, `is_hot`, `keywords`, `picture_gallery`) VALUES
(1988, 'applications', 'cn', 255, '产品应用', '', '/uploads/disney.jpg', '\n<p>协顺熟悉成本、时间和质量与安装和集成设计的每一环节。我们的定制化解决方案和一站式服务将帮助你实现缩短20%~80%的线束的安装时间, 现场组装的劳动力成本，以及BOM制定和设计等工序。连接器产品用途广泛，如：传感器&amp;工控，网络通讯，温控&amp;空调，LED照明，轨道交通，船舶&amp;海洋工程，医疗器械，可再生新能源，测试&amp;测量设备以及包装&amp;物流传送。</p>\n<div class="article artSty">\n    <h2>1. 传感器&amp;工控系统</h2>\n<img src="http://thsl.zenho.net/uploads/14312654650585.jpg" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14312654633878.jpg" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14312654640834.JPG" width="160" height="106">   \n<br><br>\n<p>工业自动化在全球经济中发挥着越来越重要的作用。自动化不仅提高了生产率和降低成本,也提高了产品的质量和稳定性。协顺的传感器/执行器、连接器和线束组件产品，专门为工业设备和机械量身打造。他们在严酷的环境条件包括腐蚀、冲击振动、灰尘、水分积聚以及极其不利的安装情况下提供安全性。各种定制化解决方案作为一个控制系统在工业机械和工厂自动化市场提供可靠的连接方案。该领域的连接器常用圆型连接器(M5 / M8 / M10 / M12 / M16/7/8”/ M20 / M23 / RD24)、M8 / M12分线盒等等。\n    </p>\n</div>\n\n<div class="article artSty">\n    <h2>2. 网络通信</h2>\n<img src="http://thsl.zenho.net/uploads/14312655463657.jpg" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14312655491201.jpg" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14312655462220.jpg" width="160" height="106">   \n<br><br>\n<p>网络通信在人们的生活和交流中扮演重要的角色。该系统是一个集终端节点、链接和任何中间节点之间的连接,以便数据传输终端或技术设施。协顺为高性能传动系统提供了可靠的连接器解决方案, 广泛用于,基础数据和网络服务器、路由器、监视器等。 涉及的产品有USB / RJ45 / DIN/D-sub / UHF/HDMI。\n    </p>\n</div>\n<div class="article artSty">\n    <h2>3. 温控&amp;空调</h2>\n<img src="http://thsl.zenho.net/uploads/14312655962117.jpg" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14312655955654.jpg" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14312655958431.jpg" width="160" height="106">   \n<br><br>\n<p>空气调节系统，是包含温度、湿度、空气清净度以及空气循环的控制系统，被称为HVAC（英语：Heating, Ventilation, Air-conditioning and Cooling）。温控&amp;空调系统设计是一个重要的机械工程学科，根据热力学、流体力学、热传递等原理涉及运行的。 协顺的传感器产品包括：NTC, PT100, PT200, PT1000。\n    </p>\n</div>\n<div class="article artSty">\n    <h2>4. LED&amp;照明</h2>\n<img src="http://thsl.zenho.net/uploads/14312656614518.jpg" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14312656513247.jpg" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14312656483405.jpg" width="160" height="106">   \n<br><br>\n<p>LED灯效率高、定向好，广泛用于各种工业领域，如舞台灯光、LED显示屏、路灯、停车场照明、人行道和其他户外区域照明、冷藏照明、城市桥梁建筑的亮化工程等等。协顺的圆形连接器(M8 / M12系列)广泛应用于LED照明应用领域。\n    </p>\n</div>\n<div class="article artSty">\n    <h2>5.  轨道交通</h2>\n<img src="http://thsl.zenho.net/uploads/14312657993825.jpg" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14312657998512.jpg" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14312657996551.jpg" width="160" height="106">   \n<br><br>\n<p>协顺明白，为了提供一个安全高效运行的铁路运输网络，我们还面临着很多亟待解决的挑战，比如，让信息技术进入轨道领域，这需要非常高的带宽传输性能，以便用于乘客信息系统、视频监控应用程序以及互联网接入以增加舒适性。 此外,在交通、网络需要在一个恶劣的环境下有效运作，需要设备具有特殊的性能和高度的弹性。协顺的工业连接器(现场总线/RJ45/以太网线束/定制化解决方案)在潮湿的条件下，在各种温度下，狭窄的空间，可以满足最高标准，安全可靠，传输距离长。\n    </p>\n</div>\n<div class="article artSty">\n    <h2>6. 船舶&amp;海洋工程</h2>\n<img src="http://thsl.zenho.net/uploads/14312669314896.jpg" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14312669311426.jpg" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14312669305372.jpg" width="160" height="106">   \n<br><br>\n<p>船舶&amp;海洋工程涉及船舶、游艇、渡轮、邮轮、雷达、GPS导航、自动驾驶仪等应用领域。该领域的设备要求具有防水和防腐特性能，尤其是连接器。 协顺的塑胶螺丝螺母锁紧方式，以及插拔式、快锁式结构，不仅可以解决防水和防腐性能问题， 还能大大减少成本，节省安装时间和劳动成本。\n    </p>\n</div>\n<div class="article artSty">\n    <h2>7. 医疗器械</h2>\n<img src="http://thsl.zenho.net/uploads/14312666112762.jpg" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14312666110287.jpg" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14312666109270.jpg" width="160" height="106">   \n<br><br>\n<p>协顺为医疗器械设备提供各种连接器和线束组件。这些产品不仅符合信号传输和高压接触，电气和机械的需求，也为客户的特殊应用要求提供可靠而稳定的质量。其中大部分用于计算机体层摄影设备、可移动辅助设备、提升需求的解决方案，医疗电子床，可转椅子和轮椅控制器。\n    </p>\n</div>\n<div class="article artSty">\n    <h2>8. 可再生新能源</h2>\n<img src="http://thsl.zenho.net/uploads/14312666325281.jpg" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14312666314312.jpg" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14312666315889.jpg" width="160" height="106">   \n<br><br>\n<p>能量来源于自然过程，太阳能、风能、地热、水力和某些形式的生物质是最常见的，更清洁、可持续的能源。协顺与时俱进，根据发展可再生能源技术趋势，开发电力、信号及混合传输的连接器和线束组件，可用于风能发电站、风力涡轮机、太阳能发电站,逆变器,和天然气,水力发电厂,安装简单,快速和可靠的。定制化的解决方案为您的特殊需求提供一站式服务。\n    </p>\n</div>\n<div class="article artSty">\n    <h2>9. 测量&amp;测试设备 </h2>\n<img src="http://thsl.zenho.net/uploads/14312666427549.jpg" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14312666423557.jpg" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14312666424702.jpg" width="160" height="106">   \n<br><br>\n<p>在测量和测试技术，精密性高于一切。 可靠的测试和决定性的结果，需要高质量的测量装置和程序，需要稳定可靠的信号连接，以保证测量数据的准确、精密。 这就要求接口与测量装置的精密度非常高。这也正是测量设备制造商选择协顺的原因。我们连接器产品用于机场称重、超市称重、测试监控系统等领域。\n    </p>\n</div>\n<div class="article artSty">\n    <h2>10. 包装&amp;物流传送 </h2>\n<img src="http://thsl.zenho.net/uploads/14312666515577.jpg" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14312666527580.jpg" width="160" height="106">\n<img src="http://thsl.zenho.net/uploads/14312666514619.jpg" width="160" height="106">   \n<br><br>\n<p>当今的供应链要求开端到终端每个环节的可查看且可实时跟踪。有效的分拣、包装和物流在处理大量的包裹从生产线到用户是必不可少的。数据采集解决方案、固定和手持扫描仪、称重和条码阅读系统，能提供准确的包裹信息，确保高效的排序。协顺的连接器解决方案性能高、可靠性强和成本效益高。\n    </p>\n</div>', '', 1434556800, 1442602118, 0, '', ''),
