INSERT INTO `bases` (`id`, `title`, `slug`, `text`, `intro`, `pic`, `province`, `city`) VALUES
(1, '七星湾试驾基地', '', '', '位于沈阳市浑南新区东湖学校附近，即杨官派出所旁；临近沈抚大道，占地总面积8.5万平方米', '/assets/img/product/base-01.jpg', '辽宁省', '沈阳'),
(2, '广州大观路试驾基地', '', '', '中国首个以汽车培训为主题的汽车基地,广州大观路试驾基地位于广州天河区大观中路，北接广深高速，南接广州中山大道，与广州奥体中心相邻，毗邻航天奇观相邻。试驾基地占地总面积三万多平方米。', '/assets/img/product/base-02.jpg', '广东', '广州'),
(3, '苏州阳澄湖试驾基地', '', '', '位于苏州相城区阳澄湖镇凤阳路5号，为全国闻名的大闸蟹产地阳澄湖畔,紧邻千年古刹皇罗禅寺,带私家码头,与阳澄湖水零距离，苏式建筑与苏式水乡风景尽收眼底。', '/assets/img/product/base-03.jpg', '江苏省', '苏州'),
(4, '深圳香蜜湖试驾基地', '', '', '深圳香蜜湖试驾基地地处深圳市福田中心区，是深圳市中心区内首家专业级的大型试驾场，占地总面积逾4万多平方米，其中场地试驾区占地3万多平米，越野体验区占地约1万多平米。', '/assets/img/product/base-03.jpg', '广东省', '深圳'),
(5, '沈阳浑南试驾基地', '', '', '测试测试测试测试测试测试测试测试', '/assets/img/product/index-base01.jpg', '湖北省', '荆州市'),
(6, '测试基地2', '', '', '测试测试测试', '/assets/img/product/base-03.jpg', '湖南省', '长沙'),
(7, '雅雅测试基地', '', '', '测试测试测试测试测试测试测试测试测试测试', '/assets/img/product/base-03.jpg', '安徽省', '合肥市');
