(2, 0, 'Contact', 'contact', 0, 0, '', '', '', 'c', 'en'),
(3, 1, 'Field-BUS', 'FIELD_BUS', 0, 4, 'Finecables sensor/actuator junction boxes provides more extension possibility to industrial field control. The junction boxes are available in 4, 6, or 8 ports with either 4 or 5 poles per port. The master cable can be configured via a 7/8" / M23 Connector or pre-molded cable on the junction box.', '/uploads/0021.jpg', '/uploads/14273628561477.jpg\n/uploads/14273628561470.jpg\n/uploads/14273628560036.jpg\n/uploads/14273628555327.jpg\n/uploads/14273628555675.jpg\n/uploads/14273628559706.jpg\n/uploads/14273628566079.jpg\n/uploads/14273628567235.jpg\n/uploads/14273628576779.jpg\n/uploads/14273628573028.jpg\n/uploads/14273628573766.jpg\n/uploads/14273628579328.jpg\n/uploads/14273628575118.jpg', 'c', 'en'),
(4, 1, 'Junction Boxes, 8 Ports', 'JB_8PORTS', 3, 0, '8-Port distribution boxes for connecting I/O in concentrated areas, are available with either 3. 4 or 5 poles of M8 or M12*1.0 per port. The master cable can be configured via a M23 or 7/8" Connector or pre-molded cable on the distribution box.', '/uploads/8_ports.jpg', '', 'c  dd ', 'en'),
(5, 1, 'Junction Boxes, 6 Ports', 'JB_6PORTS', 3, 0, '6-Port distribution boxes for connecting I/O in concentrated areas, are available with either3, 4 or 5 poles of M8 or M12*1.0 per port. The master cable can be configured via a M23 Connector or pre-molded cable on the distribution box.', '/uploads/6ports.jpg ', '', 'adsfa', 'en'),
(6, 0, 'About Us', 'about_us', 0, 0, '', '', '', 'adf', 'en'),
(7, 1, 'Circular Connectors', 'CIRCULAR_CONNECTORS', 0, 5, 'Finecables provides with unlimited circular connectors and related solutions which are suited for various industrial applications of signals, data and power. Our connection technology reduces customer''s installation times and cost. Our circular connectors have various series, which are M5, M8, M10, M12, M16, M20, 7/8", M23 and RD24. They are widely used in industrial automation, machinery, LED, traffics, control systems, and so on.', '/uploads/14285813968207.gif', '/uploads/14273611484621.jpg\n/uploads/14273611473081.jpg\n/uploads/14273611464858.jpg\n/uploads/14273611459115.jpg\n/uploads/14273612845301.jpg\n/uploads/14273612754233.jpg\n/uploads/14273612772449.jpg\n/uploads/14273613723496.jpg\n/uploads/14273613731674.jpg\n/uploads/14273613740113.jpg\n/uploads/14273613778276.jpg\n/uploads/14273613860337.jpg\n/uploads/14273613929522.jpg\n/uploads/14273623770576.jpg\n/uploads/14273623758725.jpg\n/uploads/14273627349507.jpg\n/uploads/14273627351208.jpg\n/uploads/14273627377196.jpg\n/uploads/14273627366063.jpg\n/uploads/14273627425739.jpg\n/uploads/14273627646268.jpg\n/uploads/14273627645380.jpg', 'f', 'en'),
(8, 1, 'M5', 'M5_CONNECTORS', 7, 111, 'M5 Series is specially developed for the miniature sensor market and any application that requires multiple sensors within a very small area. The product line offers 3 and 4 Pins cable cord-sets and a range of panel-mount receptacles. All connectors are either over-molded on PUR/PVC cables or panel-mount receptacles with sold-cup for wire connecting or with PCB termination for dip solder. In locked condition, this series can meet IP67 rating.', '/uploads/14201614161604.jpg', '', 'aa', 'en'),
(9, 1, 'M8', 'M8_CONNECTORS', 7, 100, 'M8 series provides a wide range of metric M8 connectors for small sensors and actuators. Shielded is available and rated to IP 67, these connectors are ideally suited for industrial control networks where small sensors are required. Connectors are either factory TPU over-molded or panel receptacles supplied with sold-cup for wire connecting or with PCB panel solder contacts. Field attachable / mountable connector is also available for your choice.', '/uploads/M8_1.jpg ', '', 'a', 'en'),
(10, 0, 'News', 'news', 0, 0, '', '', '', 'a', 'en'),
(11, 0, 'Supports & Services ', 'supports_services', 0, 0, '', '', '', 'ff', 'en'),
(35, 1, 'ISO-BUS', 'ISO_BUS', 0, 2, 'The ISOBUS standard specifies a serial data network for control and communications on forestry or agricultural tractors and implements. It consists of several parts: General standard for mobile data communication, Physical layer, Data link layer, Network layer, Network management, Virtual terminal, Implement messages applications layer, Power train messages, Tractor ECU, Task controller and management information system data interchange, Mobile data element dictionary Diagnostic, File Server.', '/uploads/14201611211396.jpg', '/uploads/14273628414758.jpg\n/uploads/14273628410273.jpg\n/uploads/14273628410542.jpg', '', 'en'),
(36, 1, 'Insutrial I/O Connectors', 'IO_CONN', 0, 2, 'Industrial Ethernet now links automation technology with the standards of the network, PC and Internet world. Finecables leads the standard connector of the office world into the harsh industrial world and also offers special solutions for cabling and assembling which compliant with IP67 degree of protection and EMC protection. Finecables Industrial Ethernet products including: RJ45 connectors, USB 2.0, Mini-DIN, D-sub connectors and UHF Connectors.', '', '/uploads/14273628135682.jpg\n/uploads/14273628132030.jpg\n/uploads/14273628155205.jpg\n/uploads/14273628123021.jpg\n/uploads/14273628127733.jpg\n/uploads/14273628139170.jpg\n/uploads/14273628131343.jpg\n/uploads/14273628134943.jpg\n/uploads/14273628156118.jpg\n/uploads/14273628155220.jpg\n/uploads/14273628206013.jpg\n/uploads/14273628201850.jpg\n/uploads/14273628207592.jpg\n/uploads/14273628212394.jpg\n/uploads/14273628211935.jpg\n/uploads/14273628212911.jpg\n/uploads/14273628220168.jpg', '', 'en'),
(37, 1, 'ISO-BUS Panel Mount', 'ISO_BUS_PANEL', 35, -1, '* ISO-BUS 11783 design standard<br>\n* Hybrid poles (5+2+2) for signal and power separately<br>\n* Panel-mount version with stainless steel<br>\n* Used in agricultural trucks and harvesters fileds<br>\n* IP65 in locked condition<br>', '/uploads/iso-bus_panel.jpg ', '', '', 'en'),
(38, 1, 'USB', 'USB_CONNECTORS', 36, 0, '* USB 2.0 A type & Mini-USB & Micro-USB available<br>\n* Shielded version available<br>\n* Over-molded, field assembly and panel-mount optional<br>\n* IP67 in locked condition<br>\n* Cable length customized, PUR/PVC cable jacket', '/uploads/302.jpg', '', '', 'en'),
(40, 1, 'new type', NULL, 10, 0, '', '', '', '', 'en'),
(41, 1, 'new type', NULL, 10, 0, '', '', '', '', 'en'),
(42, 0, 'Products Releases', 'products_releases', 10, 0, 'Keep up with Finecabes'' newest Products and get close to the state-of-the-art technology. Meanwhile, our hot products are represented for your options.', '', '', '', 'en'),
(43, 0, 'Company News', 'company_news', 10, 0, 'Every year, Finecables organizes a variety of interesting activities to enrich our work and life. As a proverb goes:<br>\nWork while work; Play while play.<br>\nThat is the way; To be cheerful and happy!', 'ff', '', '', 'en'),
(46, 0, 'Customer Support', 'customer_support', 11, 0, 'Finecables knows our customers need to locate in growth areas, so we are right there with them—designing, manufacturing, selling and servicing. We continue to expand in China, UK, South Korea, Japan, Turkey, Israel and USA by establishing sales offices、customer service centers or regional distributors. Our global presence allows us to respond quickly and offer satisfactory services with solutions tailored to the local demands of our customers.', '', '', '', 'en'),
(47, 0, 'Technical Support', 'technical_support', 11, 0, 'Technical support column offers a platform where you can understand our P/N nomenclature and get our introduction of connectors and assembly guidelines, as well as various connector applications.', '', '', '', 'en'),
(48, 0, 'Download Center', 'download_center', 11, 0, 'Here you can download the latest public versions of datasheets, including Catalogues, Brochures, Newsletters and Certificates, which will help you evaluate its extensive capabilities and facilitate your projects.', '', '', '', 'en'),
(49, 0, 'Business Trip Service', 'business_trip_service', 11, 0, 'Welcome to Business Trip Service. Here you can learn more about China Overview and we recommend domestic most popular websites where you can book your flight ticket, accommodation and journey itinerary at your earliest convenience.', '', '', '', 'en'),
(52, 0, 'Newsletter Subscription', 'newsletter_subscription', 10, 0, '', '', '', '', 'en'),
(53, 1, 'M5 Molding Cables', 'M5_MOLDING', 8, 1, '* 3,4 Poles available\n<br>\n* IP67 Protection degree\n<br>\n* TPU over-molded\n<br>\n* Customized cable length , PUR/PVC cable jacket', '/uploads/26.jpg', '', '', 'en'),
(55, 1, 'M8 Molding Cables', 'M8_MOLDING', 9, 9, '* Design per IEC 61076-2-104<br>\n* 3,4,5,6,8 Poles available<br>\n* IP67 Protection degree<br>\n* TPU over-molded or PA+GF shell<br>\n* Customized cable length , PUR/PVC cable jacket', '/uploads/14201628666299.jpg', '', '', 'en'),
(57, 1, 'Mini-Din', 'MD_CONNECTORS', 36, 10, '* 3/4/5/6/7/8/9 Poles available<br>\n* 360° EMC Shielded available<br>\n* Over-molded and panel-mount versions available<br>\n* IP67 in locked condition<br>\n* Cable length customized, PUR/PVC cable jacket', '/uploads/297.jpg ', '', '', 'en'),
(62, 1, 'RJ45', 'RJ45_CONNECTORS', 36, 0, '* RJ45 standards, 8P8C poles<br>\n* Shielded or unshielded version available<br>\n* Over-molded, field assembly and panel-mount optional<br>\n* IP67 in locked condition<br>\n* Cable length customized, PUR/PVC cable jacket', '/uploads/306.jpg', '', '', 'en'),
(63, 1, 'UHF', 'UHF_CONNECTORS', 36, 0, '* Waterproof UHF connector<br>\n* Shielded version<br>\n* Front fastened panel-mount for assembly<br>\n* IP67 in locked condition<br>', '/uploads/308.jpg', '', '', 'en'),
(64, 1, 'M12', 'M12_CONNECTORS', 7, 98, 'M12 sensor/actuator connectors with M12 locking thread for electronics automation, process control, and commercial electronics. The Series M12 offers many different cable connectors, panel mounted receptacles, field attachable/installable connectors and its accessories. Connectors have industry-standard A,B,C,D cording, for both screw-locking and quick-locking styles.', '/uploads/M12.jpg ', '', '', 'en'),
(65, 1, 'M12 Over-molding Cables', 'M12_MOLDING', 64, 0, '* 3/4/5/6/8/12/17 Poles available<br>\n* A/B/C/D/S/T/X coding<br>\n* 360° EMC Shielded or unshielded<br>\n* Over-molding type, straight or right angled version<br>\n* IP67/IP68/IP69K in locked condition<br>\n* Cable length customized, PUR/PVC cable jacket', '/uploads/14201686850637.jpg', '', '', 'en'),
(66, 1, 'M16', 'M16_CONNECTORS', 7, 97, 'Series M16 is an ideal choice for severe industrial and commercial applications. Over-molded cable and panel-mount receptacles are available in various styles and mounting methods. Quick locking wireable assembly type is also available.', '/uploads/M16.jpg ', '', '', 'en'),
(67, 1, 'M16 Over-molded Cable,Quick-lock', 'M16_MOLDED', 66, 0, '* 8/9 Poles available<br>\n* Over-molded, straight or angled available<br>\n* Quick-locking system saving more installation time<br>\n* IP65/IP67 in locked condition<br>\n* Cable length customized, PUR/PVC cable jacket', '/uploads/14201823751179.jpg', '', '', 'en'),
(68, 1, 'M5 Panel Mount', 'M5_PANEL', 8, 0, '*M5 Panel mount connectors<br>\n*3 or 4 poles<br>\n*solder/PCB type, front/rear fastened<br>\n*non-shielded/shielded', '/uploads/36.jpg', '', '', 'en'),
(69, 0, 'Certificates', 'certificates', 48, 1, '', '', '', '', 'en'),
(70, 0, 'Newsletters', 'newsletters', 48, 2, '', '', '', '', 'en'),
