(72, 0, 'Catalogues', 'catalogues', 48, 4, '该栏目不需要写', '', '', '', 'en'),
(73, 1, 'Cable Harness', 'CABLE_HARNESS', 0, 0, 'As an OEM/ODM cable harness manufacturer, FINECABLES features quick design services and prototyping that are critical in supporting an engineering effort during new product development.Our R&D team is actively supporting our clients in the development, prototyping and supply of reliable industrial cable assemblies.', '/uploads/14201883337195.jpg', '/uploads/14361428864735.jpg\n/uploads/14361428897258.jpg\n/uploads/14361428873165.jpg\n/uploads/14361428873244.jpg\n/uploads/14361428880003.jpg\n/uploads/14361428890048.jpg\n/uploads/14361458034270.jpg\n/uploads/14361476552430.jpg\n/uploads/14361526522464.png\n/uploads/14361458002409.jpg\n/uploads/14361457998939.jpg\n/uploads/14361458003816.jpg\n/uploads/14361458022639.jpg', '', 'en'),
(74, 1, 'Solenoid/Valve Plugs', 'VALVE_CONN', 0, 1, 'FINECABLES''pre-molded valve plugs provide compact and robust connection solution for the secure transmission of voltages and current for pneumatic, hydraulic and electromagnetc actuators. The current range includes verions of A, B and C, with an integrated protective circuit to reduce voltage spikes or an LED function display.', '/uploads/solenoid.jpg', '/uploads/14273627888970.jpg\n/uploads/14273627887495.jpg\n/uploads/14273627883880.jpg\n/uploads/14273627883400.jpg\n/uploads/14273627894611.jpg\n/uploads/14273627894718.jpg\n/uploads/14273627891639.jpg\n/uploads/14273627892724.jpg\n/uploads/14273627887291.jpg\n/uploads/14273627878261.jpg\n/uploads/14273627878052.jpg\n/uploads/14273627884183.jpg', '', 'en'),
(76, 1, 'M23', 'M23_CONNECTORS', 7, 94, 'Circular M23 waterproof connector was specially developed for harsh operational environment: it ensures the operation stability under moisture, vibration and temperature change. Circular M23 may be utilized in wide-ranging applications, such as industrial automation machinery and medical equipments; due to the variations in electric current, customized pin configurations are available to customers. Circular M23 with over molded cable type, assembly and panel type, designed for primarily transferring both power and analog or digital signals; metallic external shield combined with removable internal plastic component and terminals.', '/uploads/M23.jpg ', '', '', 'en'),
(77, 1, 'M10', 'M10_CONNECTORS', 7, 99, 'This style of connector is commonly used for small applications in the medical and commercial industries. The push-pull cable connector enables it very fast easy mating and available in male and female versions with 5 and 9 gold-plated contacts. When properly mated, the connection is sealed to an IP65 rating protecting from the ingress of liquids and debris.', '/uploads/M10.jpg', '', '', 'en'),
(78, 1, '7/8"', '7/8 _CONNECTORS', 7, 95, 'The 7/8" Mini-change IP67 connectors are mating-compatible with industry mini-change connectors and designed for both signal and high electricity current application. Over-molded cable and panel receptacles are available. Contacts are gold-plated. Stainless steel locking sleeve is available as an option.', '/uploads/7-8.jpg', '', '', 'en'),
(79, 1, 'RD24', 'RD24_CONNECTORS', 7, 93, 'Finecables has extended their circular connector ranges by providing RD24 Series. This series are divided into over-molded cables,field wireable assembly and panel-mount type, and they are offered with 3+PE or 6+PE poles.Screw joint or solder termination are available for connecting system. When in locked condition, this series can fulfill IP67 rating.', '/uploads/RD24.jpg', '', '', 'en'),
(80, 1, 'Junction Boxes, 4 Ports', 'JB_4PORTS', 3, 0, '4-Port distribution boxes for connecting I/O in concentrated areas, are available with either3, 4 or 5 poles of M8 or M12*1.0 per port. The master cable can be configured via a M23 Connector or pre-molded cable on the distribution box.', '/uploads/4ports.jpg ', '', '', 'en'),
(81, 1, 'ISO-BUS Molded Cable', 'ISO_BUS_MOLDED', 35, 0, '* ISO-BUS 11783 design standard<br>\n* Hybrid poles (5+2+2) for signal and power separately<br>\n* Used in agricultural trucks and harvesters fileds<br>\n* IP65 in locked condition<br>\n* Cable length customized, PUR/PVC cable jacket', '/uploads/ISOBUS.jpg ', '', '', 'en'),
(83, 1, 'D-Sub', 'D_SUB_CONNECTORS', 36, 0, '* Waterproof D-SUB & Mirco D-SUB connector<br>\n* Panel-mount, Field assembly and over-molded version optional<br>\n* 9/15/25/26/44/7W2 poles available<br>\n* IP67 in locked condition<br>', '/uploads/309.jpg', '', '', 'en'),
(84, 1, 'HDMI', NULL, 36, 0, '* Waterproof HDMI connector<br>\n* Panel-mount and over-molded version optional<br>\n* 19 poles available<br>\n* Protection cap for female connector available<br>\n* IP67 in locked condition<br>\n* Used in audio & video application fields', '/uploads/319.jpg', '', '', 'en'),
(86, 1, 'Type A', 'VALVE_A_CONNECTORS', 74, 0, 'Valve Plugs are waterproof connectors for the secure transmission of voltages and current for pneumatic,etc.They are divided into A type.', '/assets/images/pro/type2.png', '', '', 'en'),
(87, 1, 'Type B', 'VALVE_B_CONNECTORS', 74, 0, 'Valve Plugs are waterproof connectors for the secure transmission of voltages and current for pneumatic,etc.They are divided into B type.', '/uploads/B_285.jpg', '', '', 'en'),
(89, 1, 'Type C', 'VALVE_C_CONNECTORS', 74, 0, 'Valve Plugs are waterproof connectors for the secure transmission of voltages and current for pneumatic,etc.They are divided into C type.', '/uploads/C_286.jpg', '', '', 'en'),
