(125, 1, 'M8 Field Wirable Assembly', 'M8_ASSEMBLY', 9, 0, '* IP67\n<br>\n* 3/4/5/6/8 poles available\n<br>\n* field wirable assembly type\n<br>\n* Cable length customized, PUR/PVC cable jacket', '/uploads/14201655227113.jpg', '', '', 'en'),
(126, 1, 'M8 Panel-mount', 'M8_PANEL', 9, 0, '* IP67\n<br>\n* 3/4/5/6/8 poles available\n<br>\n* panel-mount type,front/rear fastened\n<br>\n* Cable length customized, PVC wires available', '/uploads/14201650574331.jpg', '', '', 'en'),
(127, 1, 'M8 Adapters/Splitters/Terminator', 'M8_SPLITTER', 9, 0, '* 3/4/5 poles available<br>\n* Y-Spiltter/ L-Adapter<br>\n* Terminator with LED indicator<br>\n* IP67 protection degree', '/uploads/14201650571819.jpg', '', '', 'en'),
