(129, 1, 'M10 Over-molding Cables', 'M10_MOLDING', 77, 0, '* 5/9 poles available<br>\n* Over-molding type<br>\n* Snap-in locking system; easy for installation/assembly<br>\n* Cable length customized, PVC wires available', '/uploads/14201650595355.jpg', '', '', 'en'),
