(132, 1, 'M12 Field Wirable Assembly', 'M12_ASSEMBLY', 64, 0, '* 3/4/5/6/8/12/17 Poles available<br>\n* A/B/C/D/S/T/X coding<br>\n* Shielded or unshielded<br>\n* Field wirable assembly type, with solder or screw joint termination<br>\n* IP67/IP68/IP69K in locked condition<br>\n* Cable length customized, PUR/PVC cable jacket', '/uploads/14201784147635.jpg', '', '', 'en'),
(133, 1, 'M12 Panel-mount Connectors', 'M12_PANEL', 64, 0, '* 3/4/5/8/12/17 Poles available<br>\n* A/B/C/D/S/T/X coding<br>\n* Solder or PCB type,Shielded or unshielded<br>\n* Panel-mount type with die-casting screw/machined versions<br>\n* Wire type & length customized<br>\n* IP67/IP68/IP69K in locked condition', '/uploads/14201789703762.jpg', '', '', 'en'),
(135, 1, 'M12 Splitters/Adapters', 'M12_SPLITTER', 64, 0, '* 3/4/5/8 Poles available<br>\n* A/B/D coding<br>\n* Metal screw/nut or Plastic version<br>\n* T/Y-slitters, I-adapters,multi-way splitters<br>\n* Wire type & length customized<br>\n* IP67 in locked condition', '/uploads/14201794908389.jpg', '', '', 'en'),
(136, 1, 'M12 Terminators', 'M12_TERMINATOR', 64, 0, '* 3/4/5/6/8/12/17 Poles available<br>\n* A/B/C/D coding<br>\n* Metal screw/nut or Plastic version<br>\n* IP67 in locked condition', '/uploads/14201794908842.jpg', '', '', 'en'),
(137, 1, 'M12 Plastic Housings', 'M12_HOUSING', 64, 0, '* 3/4/5/8 Poles available<br>\n* A/B/D coding<br>\n* Plastic housing with Solder or PCB type<br>\n* Wire type & length customized<br>\n* IP67 in locked condition', '/uploads/14201794916336.jpg', '', '', 'en'),
(138, 1, 'M12 Protection Caps', 'M12_CAP', 64, 0, '* Plastic protection cap for M12 male/female connector<br>\n* Available for over-molded, panel and other types<br>\n* Plus strip or loop available<br>\n* IP67 in locked condition', '/uploads/14201684374475.jpg', '', '', 'en'),
(143, 1, 'M16 Field Wirable Assembly', 'M16_ASSEMBLY', 66, 0, '* 8/9 Poles available<br>\n* Field installation assembly, straight version<br>\n* Quick-locking system save installation time<br>\n* IP65/IP67 in locked condition<br>\n* Cable length customized, PUR/PVC cable jacket', '/uploads/14201823755665.jpg', '', '', 'en'),
(144, 1, 'M16 Panel-mount Connectors', 'M16_PANEL', 66, 0, '* 8/9 Poles available<br>\n* Panel-mount, solder or PCB termination<br>\n* Quick-locking system save installation time<br>\n* IP65/IP67 in locked condition<br>', '/uploads/14201823759407.jpg', '', '', 'en'),
(145, 1, 'M16 Protection Caps', NULL, 66, 0, '* Protection caps for M16 male/female connector<br>\n* Loop/Strip available<br>\n* IP65/IP67 in locked condition<br>', '/uploads/14201823765599.jpg', '', '', 'en'),
(146, 1, 'M20 Over-molded Cables', 'M20_MOLDED', 75, 0, '* 3+5 Poles for signal & power transmission<br>\n* PBT connector insert<br>\n* Over-molded straight type<br>\n* IP67 in locked condition<br>\n* Cable length customized, PUR/PVC cable jacket', '/uploads/14201827389783.jpg', '', '', 'en'),
(147, 1, 'M20 Adapters/Terminators', 'M20_ADAPTERS', 75, 0, '* 3+5 Poles hybrid poles for signal & power transmission<br>\n* 1.5A for signal & 13A for power transmission<br>\n* U-adapter & Terminators<br>\n* IP67 in locked condition<br>', '/uploads/14201827395425.jpg', '', '', 'en'),
(148, 1, 'M20 Panel-mount Connectors', 'M20_PANEL', 75, 0, '* 3+5 Poles hybrid poles for signal & power transmission<br>\n* 1.5A for signal & 13A for power transmission<br>\n* Panel-mount with solder termination<br>\n* IP67 in locked condition<br>', '/uploads/14201827396994.jpg', '', '', 'en'),
