(176, 1, 'Wire/Cable Harness', 'WIRE_HARNESS', 73, 0, 'Finecables can be your One Source for all your custom and standard cables needs. We provide with a wide range of standard and customized wire harnesses and cable assembly for both power and data transmission solutions and consist of various types and sizes of wire, solder and crimp type terminals and pins, along with various electrical components specified by our customer.', '/uploads/14201883337195.jpg', '', '', 'en'),
(179, 1, 'Temperature Sensor Cables', 'SENSOR_CABLES', 73, 0, 'For Heating and cooling system, accurate reliable temperature control Finecables sensor cable enables you keep track of the temperature \nin and outside a building. Finecables sensor product range includes: \nNTC, PT100, PT200, PT500 and PT1000 sensors and transmitters and\navailable in a wide range of mounting versions.', '/uploads/14361458034270.jpg', '', '', 'en'),
