(231, 1, '圆型连接器', 'CIRCULAR_CONNECTORS', 0, 100, '协顺电子科技为工业数据、信号、电源的传输提供各种圆形防水连接器和配套的解决方案。凭借专业的工业连接器制造技术与经验,协顺为客户的工业连接提供省时简易的产品安装方案，降低客户成本。我司生产的圆形防水连接器主要有M5、M8、M10、M12、M16、M20、7/8"、M23、RD24，广泛应用于工业自动化、机械设备、LED照明、交通轨道、控制系统等领域。', '/uploads/14285813968207.gif', '/uploads/14273611484621.jpg\n/uploads/14273611473081.jpg\n/uploads/14273611464858.jpg\n/uploads/14273611459115.jpg\n/uploads/14273612845301.jpg\n/uploads/14273612754233.jpg\n/uploads/14273612772449.jpg\n/uploads/14273613723496.jpg\n/uploads/14273613731674.jpg\n/uploads/14273613740113.jpg\n/uploads/14273613778276.jpg\n/uploads/14273613860337.jpg\n/uploads/14273613929522.jpg\n/uploads/14273623770576.jpg\n/uploads/14273623758725.jpg\n/uploads/14273627349507.jpg\n/uploads/14273627351208.jpg\n/uploads/14273627377196.jpg\n/uploads/14273627366063.jpg\n/uploads/14273627425739.jpg\n/uploads/14273627646268.jpg\n/uploads/14273627645380.jpg', '', 'cn'),
(232, 1, 'Field-BUS 分线盒', 'FIELD_BUS', 0, 0, '分线盒可以有条不紊的将传感器和执行器连接起来，达到现场总线控制。多位式M8/M12分线盒额外匹配M12/7/8"/M23连接头，便于实现一对多的端口数据信号传输，节约成本，安装简易。同时，端口处有显眼的LED指示灯，可以方便对线路进行诊断。', '/uploads/0021.jpg', '/uploads/14273628561477.jpg\n/uploads/14273628561470.jpg\n/uploads/14273628560036.jpg\n/uploads/14273628555327.jpg\n/uploads/14273628555675.jpg\n/uploads/14273628559706.jpg\n/uploads/14273628566079.jpg\n/uploads/14273628567235.jpg\n/uploads/14273628576779.jpg\n/uploads/14273628573028.jpg\n/uploads/14273628573766.jpg\n/uploads/14273628579328.jpg\n/uploads/14273628575118.jpg', '', 'cn'),
(233, 1, 'ISO-BUS', 'ISO_BUS', 0, 0, 'ISO-BUS 11783标准是应用于农业森林机械的串行网络通信协议。它由如下几部分组成：移动数据通信物理层，数据链路层，网络层，网络管理，虚拟终端通用标准，实施信息应用层，动力传动系信息，拖拉机的ECU，任务控制和管理信息系统的数据交换等等。', '/uploads/14201611211396.jpg', '/uploads/14273628414758.jpg\n/uploads/14273628410273.jpg\n/uploads/14273628410542.jpg', '', 'cn'),
(234, 1, '工业IO连接器', 'IO_CONN', 0, 0, '标准化的数据接口被用于工业应用场合,从而满足了复杂生产系统的分布式控制以及日益提高的对信息和数据快速传输的要求。协顺以其专业的技术与研发能力为传统的标准办公室网络接口向苛刻的工业网络连接发展提供可靠的解决方案。其主要工业数据传输产品包括：IP67 USB2.0、MINI-DIN、RJ45、UHF、M12-RJ45、D-SUB、HDMI等工业防水、防尘、防油连接器。', '', '/uploads/14273628135682.jpg\n/uploads/14273628132030.jpg\n/uploads/14273628155205.jpg\n/uploads/14273628123021.jpg\n/uploads/14273628127733.jpg\n/uploads/14273628139170.jpg\n/uploads/14273628131343.jpg\n/uploads/14273628134943.jpg\n/uploads/14273628156118.jpg\n/uploads/14273628155220.jpg\n/uploads/14273628206013.jpg\n/uploads/14273628201850.jpg\n/uploads/14273628207592.jpg\n/uploads/14273628212394.jpg\n/uploads/14273628211935.jpg\n/uploads/14273628212911.jpg\n/uploads/14273628220168.jpg', '', 'cn'),
(235, 1, '电磁阀', 'VALVE_CONN', 0, 0, '传统型电磁阀连接器是基于预装配，新一代的连接器以套件式供应，大大减少部件组装的时间。新一代电磁阀连接器（A型、B型、C型）旨在提高性能和可靠性，符合IP67超高密封性能和卓越的配线设计并满足降低产品应用于液压，气动和电磁设备的成本。', '/uploads/solenoid.jpg', '/uploads/14273627888970.jpg\n/uploads/14273627887495.jpg\n/uploads/14273627883880.jpg\n/uploads/14273627883400.jpg\n/uploads/14273627894611.jpg\n/uploads/14273627894718.jpg\n/uploads/14273627891639.jpg\n/uploads/14273627892724.jpg\n/uploads/14273627887291.jpg\n/uploads/14273627878261.jpg\n/uploads/14273627878052.jpg\n/uploads/14273627884183.jpg', '', 'cn'),
(236, 1, '线束组件', 'CABLE_HARNESS', 0, 0, '经过多年给不同行业的客户供应线束组件产品，协顺知道如何与客户沟通并以行动为客户的需求制定出满意的解决方案。作为OEM / ODM线束组件制造商，协顺以专业、积极、快速的设计与制模打样能力协助客户在新项目上的开发。协顺在提供完全符合客户要求的线束产品的同时，也为客户提供产品开发设计协助服务。我们相信通过与客户的通力合作，一定能为客户制定出满意的连接方案。', '/uploads/14201883337195.jpg', '/uploads/14361428864735.jpg\n/uploads/14361428897258.jpg\n/uploads/14361428873165.jpg\n/uploads/14361428873244.jpg\n/uploads/14361428880003.jpg\n/uploads/14361428890048.jpg\n/uploads/14361458034270.jpg\n/uploads/14361476552430.jpg\n/uploads/14361526522464.png\n/uploads/14361458002409.jpg\n/uploads/14361457998939.jpg\n/uploads/14361458003816.jpg\n/uploads/14361458022639.jpg', '', 'cn'),
(237, 1, 'M5', 'M5_CONNECTORS', 231, 20, '随着自动化领域的元件的高度集成化，元件也越来越小型化，如M5系列连接器，有3芯,4芯结构，分为注塑成型式和面板式（焊接型端子、PCB型端子），可注塑成型在PUR/PVC线材或者焊接电子线或者焊接PCB板上。皆可达到IP67防护等级。', '/uploads/14201614161604.jpg', '', '', 'cn'),
(238, 1, 'M8', 'M8_CONNECTORS', 231, 19, 'M8系列圆形连接器为小型或特殊工业用途的机械工程提供了实用、经济和灵活的解决方案，并满足了在有限空间内迅速无误地连接要求。该系列有注塑成型式、面板式、组装式、分支器、终端器等类型，以及相匹配的防护盖。', '/uploads/M8_1.jpg ', '', '', 'cn'),
(239, 1, '分线盒 8位', 'JB_8PORTS', 232, 10, '8位式M8/M12分线盒额外匹配M12/7/8"/M23连接头， 便于实现一对多的端口数据信号传输， 节约成本， 安装简易。 同时， 端口处有显眼的LED指示灯， 可以方便对线路进行诊断。', '/uploads/8_ports.jpg', '', '', 'cn'),
(240, 1, 'A型', 'VALVE_A_CONNECTORS', 235, 0, '防水电磁阀是为了更好的安全传输电压与气动传输.以下这些些归为A型.', '/assets/images/pro/type2.png', '', '', 'cn'),
(241, 1, 'B型', 'VALVE_B_CONNECTORS', 235, 0, '防水电磁阀是为了更好的安全传输电压与气动传输.以下这些些归为B型.', '/uploads/B_285.jpg', '', '', 'cn'),
(242, 1, 'C型', 'VALVE_C_CONNECTORS', 235, 0, '防水电磁阀是为了更好的安全传输电压与气动传输.以下这些些归为C型.', '/uploads/C_286.jpg', '', '', 'cn'),
(243, 1, 'M5 成型式', 'M5_MOLDING', 237, 0, '* 3,4 芯<br>\n* IP67 防护等级<br>\n* TPU 注塑成型<br>\n* 可定制线材长度，PUR/PVC线材外被可选', '/uploads/26.jpg', '', '', 'cn'),
(244, 1, 'M5 面板式', 'M5_PANEL', 237, 0, '* M5面板式连接器<br>\n* 3,4 芯<br>\n* 螺纹式锁紧方式<br>\n* 焊接型/PCB型<br>\n* 非屏蔽/屏蔽', '/uploads/36.jpg', '', '', 'cn'),
