(249, 0, '企业资讯', 'products_releases', 247, 0, '关注协顺新品，与科技同步。我们的产品是您最佳选择。', '', '', '', 'cn'),
(250, 0, '行业动态', 'company_news', 247, 0, '协顺每年都会组织丰富的康体活动，丰富全体员工的工作和生活。比如，拔河、跳绳、乒乓球、篮球等比赛，以及春节晚会。快乐工作，健康生活！<br>', '', '', '', 'cn'),
(252, 0, '活动集锦', 'newsletter_subscription', 247, 0, '', '', '', '', 'cn'),
(253, 0, '客户支持', 'customer_support', 248, 4, '“协顺科技”知道顾客都需要业务增长，所以我们为其研发、制造、销售和服务。通过建立销售办事处、客户服务中心或区域经销商，我们将服务范围扩展至中国、英国、韩国、日本、土耳其、以色列和美国。 我们的业务遍及全球，能够根据当地客户的特殊需求迅速做出反应、并提供量身定做的解决方案和满意的服务。', '', '', '', 'cn'),
(254, 0, '下载中心', 'download_center', 248, 1, '您可以在这里下载最新的数据资料，如目录、宣传册、新闻发布稿或证书。它们将有益于您评估设计的可行性，促进项目的进展。', '', '', '', 'cn'),
(255, 0, '技术支持', 'technical_support', 248, 3, '技术支持栏目提供了服务平台，便于广大客户充分熟悉我们的产品命名、了解连接器知识和应用领域，还可以懂得部分连接器的现场组装指南。', '', '', '', 'cn'),
(256, 0, '商旅服务', 'business_trip_service', 248, 0, '欢迎来到商旅平台。在这里，您可以深入了解中国概况。同时，我们问您推荐国内最受欢迎的网址，极大方便您在中国商务旅行期间的衣食住行的安排。', '', '', '', 'cn'),
