(319, 1, 'M8 成型式', 'M8_MOLDING', 238, 0, '* 3,4,5,6,8 芯<br>\n* IP67 防护等级<br>\n* TPU 注塑成型<br>\n* 可定制线材长度，PUR/PVC线材外被可选', '/uploads/14201628666299.jpg', '', '', 'cn'),
