(321, 1, 'M8 面板式', 'M8_PANEL', 238, 0, '* M8面板式连接器<br>\n* 3,4,5,6,8 芯<br>\n* 螺纹式锁紧方式<br>\n* 焊接型/PCB型<br>\n* 非屏蔽/屏蔽', '/uploads/14201650574331.jpg', '', '', 'cn'),
(322, 1, 'M8 分支器/转换器/终端器', 'M8_SPLITTER', 238, 0, '* 3,4,5 芯<br>\n* IP67 防护等级<br>\n* Y型分支器，L型转换器<br>\n* 终端器，带LED指示灯', '/uploads/14201650571819.jpg', '', '', 'cn'),
(323, 1, 'M8 防护盖', 'M8_CAP', 238, 0, '* M8公头/母头连接器防护盖<br>\n* 带线(带)环或无线(带)环<br>\n* IP67 防护等级', '/uploads/14201650584290.jpg', '', '', 'cn'),
(325, 1, 'M12', 'M12_CONNECTORS', 231, 17, '广泛应用于工业自动化、轨道交通、船舶及新能源等领域。产品种类涵盖：成型带线式、组装式、面板式、分支器、转化器、终端器和配件防护盖等类型。其机械防呆接口分为A、B、C、D、S、T、X等类型。防护等级可达到IP67、IP68、IP69K，有屏蔽型结构供终端客户选择。', '/uploads/M12.jpg ', '', '', 'cn'),
(326, 1, 'M12 成型式', 'M12_MOLDING', 325, 0, '* 3/4/5/6/8/12/17芯<br>\n* A/B/C/D/S/T/X接口防呆类型<br>\n* 360° 屏蔽或者不带屏蔽<br>\n* TPU注塑成型式，直头或者弯头可选<br>\n* IP67/IP68/IP69K防护等级<br>\n* 可定制线材长度，PUR/PVC线材外被可选', '/uploads/14201686850637.jpg', '', '', 'cn'),
(327, 1, 'M12 组装式', 'M12_ASSEMBLY', 325, 0, '* 3/4/5/6/8/12/17 芯<br>\n* A/B/C/D/S/T/X接口防呆类型<br>\n* 360° 屏蔽或者不带屏蔽<br>\n* IP67/IP68/IP69K 防护等级<br>\n* 组装式<br>\n* 焊接型或锁端子型', '/uploads/14201784147635.jpg', '', '', 'cn'),
(328, 1, 'M12 面板式', 'M12_PANEL', 325, 0, '* 3/4/5/8/12/17 芯<br>\n* A/B/C/D/S/T/X接口防呆类型<br>\n* 非屏蔽/屏蔽\n* IP67/IP68/IP69K 防护等级<br>\n* 螺纹式锁紧方式<br>\n* 焊接型/PCB型', '/uploads/14201789703762.jpg', '', '', 'cn'),
(329, 1, 'M10', 'M10_CONNECTORS', 231, 18, '该系列设计为快速插拔式结构，便于现场组装安装，且达到IP65防护等级，广泛适用于医疗和机械领域。', '/uploads/M10.jpg', '', '', 'cn'),
(330, 1, 'M10 成型式', 'M10_MOLDING', 329, 0, '* 5,9 芯<br>\n* IP65 防护等级<br>\n* TPU 注塑成型<br>\n* 快速插拔式便捷安装<br>\n* 可定制线材长度，PUR/PVC线材外被可选', '/uploads/14201650595355.jpg', '', '', 'cn'),
(331, 1, 'M10 防护盖', 'M10_CAP', 329, 0, '* M10母头连接器防护盖<br>\n* 快速插拔式<br>\n* IP65 防护等级', '/uploads/14201686849186.jpg', '', '', 'cn'),
(332, 1, 'M12 分支器/转换器', 'M12_SPLITTER', 325, 0, '* 3/4/5/8 芯<br>\n* A/B/D接口防呆类型<br>\n* Y型分支器，T型分支器，L型转换器，I型连换器<br>\n* IP67 防护等级', '/uploads/14201794908389.jpg', '', '', 'cn'),
(333, 1, 'M12 终端器', 'M12_TERMINATOR', 325, 0, '* 3/4/5/6/8/12/17 芯<br>\n* A/B/C/D接口防呆类型<br>\n* IP67 防护等级<br>', '/uploads/14201794908842.jpg', '', '', 'cn'),
(334, 1, 'M12 胶芯式', 'M12_HOUSING', 325, 0, '* 3/4/5/8 芯<br>\n* A/B/D接口防呆类型<br>\n* IP67 防护等级<br>\n* 焊接型/PCB型', '/uploads/14201794916336.jpg', '', '', 'cn'),
(335, 1, 'M12 防护盖', 'M12_CAP', 325, 0, '* M12公头/母头连接器防护盖<br>\n* 带线(带)环或无线(带)环<br>\n* IP67 防护等级', '/uploads/14201684374475.jpg', '', '', 'cn'),
(336, 1, 'M16', 'M16_CONNECTORS', 231, 16, 'M16系列圆形连接器，专门为客户特殊应用领域开发的产品。该系列分为注塑成型式、组装式、面板式。快锁锁紧结构设计便于客户现场安装使用。', '/uploads/M16.jpg ', '', '', 'cn'),
(337, 1, 'M16 成型式，快锁式', 'M16_MOLDED', 336, 0, '* 8/9 芯<br>\n* 注塑成型式，直头&弯头可选<br>\n* 快锁式锁紧结构设计，节约安装时间<br>\n* IP65/IP67锁紧状态<br>\n* 线材长度定制化，PUR/PVC外被可选', '/uploads/14201823751179.jpg', '', '', 'cn');
