(338, 1, 'M16 组装式，快锁式', 'M16_ASSEMBLY', 336, 0, '* 8/9 芯<br>\n* 现场组装式，直头&弯头可选<br>\n* 快锁式锁紧结构设计，节约安装时间<br>\n* IP65/IP67锁紧状态<br>\n* 线材长度定制化，PUR/PVC外被可选', '/uploads/14201823755665.jpg', '', '', 'cn'),
(339, 1, 'M16 面板式，快锁式', 'M16_PANEL', 336, 0, '* 8/9 芯<br>\n* 板式安装，焊接型端子和PCB型端子可选<br>\n* 快锁式锁紧结构设计，节约安装时间<br>\n* IP65/IP67锁紧状态<br>', '/uploads/14201823759407.jpg', '', '', 'cn'),
(340, 1, 'M16 防护盖', 'M16_CAPS', 336, 0, '* M16 公/母头防护盖<br>\n* 可带线环或线圈<br>\n* IP65/IP67 锁紧状态<br>', '/uploads/14201823765599.jpg', '', '', 'cn'),
(342, 1, 'M20 成型式', 'M20_MOLDED', 341, 0, '* 3+5芯 信号电源混合型端子<br>\n* PBT 胶芯<br>\n* 注塑成型式，直头<br>\n* IP67 锁紧状态<br>\n* 线材长度定制化，PUR/PVC外被可选', '/uploads/14201827389783.jpg', '', '', 'cn'),
(343, 1, 'M20 转换器/终端器', 'M20_ADAPTERS', 341, 0, '* 3+5芯 信号电源混合型端子<br>\n* 信号电流：1.5A； 电源电流：13A<br>\n* U型公母转换器<br>\n* IP67 锁紧状态<br>', '/uploads/14201827395425.jpg', '', '', 'cn'),
(344, 1, '', '', 341, 0, '', '', '', '', 'cn'),
(346, 1, '7/8"', '7/8_CONNECTORS', 231, 14, 'Mini-Change (7/8")连接器广泛用于欧洲和北美市场，3~16芯，承受额定电流4A-13A适用于信号与电源传输。该系列包含成型式、组装式、面板式和分支器，可以达到IP67防护等级。', '/uploads/7-8.jpg', '', '', 'cn'),
(347, 1, '7/8" 成型式', '7/8_MOLDED', 346, 0, '* 3/4/5/16/10(3+7) 芯<br>\n* 7/8"-16UN-2A/2B 螺纹<br>\n* 铝合金黑色阳极氧化螺丝螺母<br>\n* 注塑成型式，直头&弯头可选<br>\n* IP67防护等级<br>\n* 线材长度定制化，PUR/PVC外被可选', '/uploads/14201827406903.jpg', '', '', 'cn'),
(348, 1, '7/8“ 组装式', '7/8_ASSEMBLY', 346, 0, '* 3/4/5/16/10(3+7) 芯<br>\n* 7/8"-16UN-2A/2B 螺纹<br>\n* 铝合金黑色阳极氧化螺丝螺母<br>\n* 现场组装式，直头&弯头可选<br>\n* 锁端子式连接方式，线径OD6.0~10.0mm<br>\n* IP67防护等级<br>\n* 线材长度定制化，PUR/PVC外被可选', '/uploads/14201829585960.jpg', '', '', 'cn'),
(349, 1, '7/8” 面板式', '7/8_PANEL', 346, 0, '* 3/4/5/16/10(3+7) 芯<br>\n* 7/8"-16UN-2A/2B 螺纹<br>\n* 铝合金黑色阳极氧化螺丝螺母<br>\n* 面板式，前锁、后锁可选<br>\n* IP67防护等级<br>', '/uploads/14201829607771.jpg', '', '', 'cn'),
(350, 1, '7/8“ 分支器/转换器', '7/8_ADAPTERS', 346, 0, '* 3/4/5 芯<br>\n* 7/8"-16UN-2A/2B 螺纹<br>\n* 铝合金黑色阳极氧化螺丝螺母<br>\n* T型、Y型分支器，或者I型转换器<br>\n* IP67防护等级<br>', '/uploads/14201830305468.jpg', '', '', 'cn'),
(351, 1, '7/8” 防护盖', '7/8_CAPS', 346, 0, '* 7/8" 公/母头防护盖<br>\n* 带线环可选<br>\n* IP67防护等级<br>', '/uploads/14201830309693.jpg', '', '', 'cn'),
(352, 1, 'M23', 'M23_CONNECTORS', 231, 13, 'M23系列防水连接器专为苛刻的工业作业环境而设计开发的，兼具防水、耐潮、防振及外力撞击等特点。该系列连接器应用广泛，如，工业自动化机械和医疗设备。为应对电流变化而定制引脚结构。M23系列细分为成型注塑式，组装式和面板式，主要用于电源传输和模拟或数字信号传输等应用;外部金属全屏蔽，内部塑胶部件和金属端子可以拆卸组装。', '/uploads/M23.jpg ', '', '', 'cn'),
(353, 1, 'M23 成型式', 'M23_MOLDED', 352, 0, '* 6/7/8/9/12/16/17/19 芯<br>\n* 信号与电源类连接器<br>\n* 全屏蔽<br>\n* 减震设计锁定系统<br>\n* IP67 紧锁状态<br>\n* 可定制PVC/PUR线材', '/uploads/14201830329055.jpg', '', '', 'cn'),
(354, 1, 'M23 组装式', 'M23_ASSEMBLY', 352, 0, '* 6/7/8/9/12/16/17/19 芯<br>\n* 信号与电源类连接器<br>\n* 全屏蔽<br>\n* 减震设计锁定系统<br>\n* IP67 紧锁状态<br>\n* 可定制PVC/PUR线材', '/uploads/14201832586575.jpg', '', '', 'cn'),
(355, 1, 'M23 面板式', 'M23_PANEL', 352, 0, '* 6/7/8/9/12/16/17/19 芯<br>\n* 信号与电源类连接器<br>\n* 面板式，前锁或者后锁<br>\n* 全屏蔽<br>\n* 减震设计锁定系统<br>\n* 防护等级IP67 紧锁状态<br>', '/uploads/14355202216385.jpg', '', '', 'cn'),
(356, 1, 'M23 信号类组装工具', 'M23_ACCESSORIES', 352, 0, '* 信号类组装工具<br>\n* 公/母头<br>\n* 为组装式产品而设计<br>', '/uploads/14201833246345.jpg', '', '', 'cn'),
(357, 1, 'RD24', 'RD24_CONNECTORS', 231, 12, 'RD24系列连接器的成功开发，极大丰富了我司圆形连接器的范围。该系列主要应用于石油、天然气等能源领域的驱动控制系统。目前有注塑成型式、组装式、面板式，2/3/4/7 公/母直头。锁紧状态下，可以达到IP67防护等级。', '/uploads/RD24.jpg', '', '', 'cn'),
(358, 1, 'RD24 成型式', 'RD24_MOLDED', 357, 0, '* 1+PE/2+PE/3+PE/4+PE 芯<br>\n* RD24 线程设计<br>\n* PBT 胶芯<br>\n* 成型式，焊接型<br>\n* IP67防护等级,紧锁状态下<br>\n* 可定制PVC/PUR线材', '/uploads/14201834558332.jpg', '', '', 'cn'),
(359, 1, 'RD24 组装式', 'RD24_ASSEMBLY', 357, 0, '* 1+PE/2+PE/3+PE/4+PE 芯<br>\n* RD24 线程设计<br>\n* PBT 胶芯<br>\n* 组装式，焊接型<br>\n* IP67防护等级,紧锁状态下<br>\n* 可定制PVC/PUR线材', '/uploads/14201834566662.jpg', '', '', 'cn'),
(360, 1, 'RD24 面板式', 'RD24_PANEL', 357, 0, '* 1+PE/2+PE/3+PE/4+PE 芯<br>\n* RD24 线程设计<br>\n* 面板式，前锁压接型<br>\n* IP67防护等级,紧锁状态下', '/uploads/14201834562031.jpg', '', '', 'cn'),
(361, 1, '分线盒 6位', 'JB_6PORTS', 232, 9, '6位式M8/M12分线盒额外匹配M12/7/8"/M23连接头， 便于实现一对多的端口数据信号传输， 节约成本， 安装简易。 同时， 端口处有显眼的LED指示灯， 可以方便对线路进行诊断。', '/uploads/6ports.jpg ', '', '', 'cn'),
(362, 1, '分线盒 4位', 'JB_4PORTS', 232, 8, '4位式M8/M12分线盒额外匹配M12/7/8"/M23连接头， 便于实现一对多的端口数据信号传输， 节约成本， 安装简易。 同时， 端口处有显眼的LED指示灯， 可以方便对线路进行诊断。', '/uploads/4ports.jpg ', '', '', 'cn'),
