(372, 1, 'USB', 'USB_CONNECTORS', 234, 19, '* USB 2.0 A type & Mini-USB & Micro-USB <br>\n* 屏蔽<br>\n* 成型式与面板式<br>\n* IP67 紧锁状态<br>\n* 可定制PVC/PUR线材', '/uploads/302.jpg', '', '', 'cn'),
(373, 1, 'RJ45水晶头', 'RJ45_CONNECTORS', 234, 18, '* 标准RJ45, 8P8C poles<br>\n* 可屏蔽或者不屏蔽<br>\n* 成型式与面板式<br>\n* IP67 紧锁状态<br>\n* 可定制PVC/PUR线材', '/uploads/306.jpg', '', '', 'cn'),
(374, 1, 'UHF', 'UHF_CONNECTORS', 234, 17, '* 防水UHF连接器<br>\n* 屏蔽行<br>\n* Front fastened panel-mount for assembly<br>\n* IP67 紧锁状态<br>', '/uploads/308.jpg', '', '', 'cn'),
