(376, 1, 'HDMI', 'HDMI_CONNECTORS', 234, 14, '* HDMI 防水连接器<br>\n* 成型式、面板式<br>\n* 19 Pin<br>\n* 母头防尘盖<br>\n* IP67 紧锁状态<br>\n* Used in audio & video application fields', '/uploads/319.jpg', '', '', 'cn'),
(377, 1, '线束连接器', 'WIRE_HARNESS', 236, 10, '协顺致力于成为行业里一家集卓越的设计、制造、销售与服务为一体的连接产品与方案提供商。协顺所建立的专业线束组件制造加工团队，以其迅速的反应能力、优化的生产与作业程序、国际认证或第三方测试通过的质量保证和具竞争力的价格，为客户提供了完备的解决方案与产品服务。为客户提供线束组件及连接器产品的同时，协顺也为客户提供产品相关配件的采购或加工、设计协助、成品测试、包装和物流等服务。', '/uploads/14201883337195.jpg', '', '', 'cn'),
(378, 1, '传感器', 'SENSOR_CABLES', 236, 9, '协顺依托在业界的强有力的协作能力，在温湿度传感器产品领域已有多年为客户提供OEM/ODM工业用与民用温湿度传感器的加工生产经验。其产品包括：NTC, PT100，PT200，PT500和PT1000 等系列室内温度传感器、室外温度传感器、风管温度传感器、浸入式温度传感器、室内湿度传感器、风管湿度传感器、室外湿度传感器等范围广泛的传感器系列。', '/uploads/14361458034270.jpg', '', '', 'cn'),
(380, 1, '电缆线材', 'RAW_CABLE_WIRES', 236, 0, '协顺电缆线材种类多样，包含各种电线、电缆、特种电缆和电缆配件，广泛应用于数据、网络和现场总线布线以及操纵系统。最为重要的是，我们可以按照客户特殊要求，提供设计定制化电缆和解决方案。', '/uploads/14361526522464.png', '', '', 'cn'),
