(387, 1, 'Push-pull', 'PUSH_PULL_CONN', 7, 0, 'The push-pull connectors integrate the push lock mechanism together with audible and tactile feedback,Finecable''s Push-pull series connector is the ideal mating solution for fast and easy operation in medical and industrial applications.These products are particularly suitable for high reliability and high quality where a simple yet fast method to connect/disconnect is required,and also suitable for high endurance and ease of operation in very limited spaces.', '/uploads/1.44835741384E+13.png', '', '', 'en'),
(388, 1, 'Push-pull Assembly', 'PUSH_PULL_ASSM', 387, 0, '* Field installable and free assembled versions <br>\n* Wire gauge range from 30AWG to 12AWG<br>\n* Fast and easy to use<br>\n* Mechanically keyed: ensures correct polarization and alignment<br>\n* IP67 in locked condition<br>\n* Cable length customized, PUR/PVC cable jacket', '/uploads/1.44851885246E+13.png', '', '', 'en'),
(389, 1, 'Push-pull panel-mount', 'PUSH_PULL_PANEL', 387, 0, '* PCB or Right Angled PCB contacts available<br>\n* Solder or PCB types optional<br>\n* Wire gauge range from 30AWG to 12AWG<br>\n* Contacts layout from 2 to 32 contacts<br>\n* Fast and easy to use<br>\n* Mechanically keyed: ensures correct polarization and alignment<br>\n* IP67 in locked condition<br>', '/uploads/1.44851885218E+13.png', '', '', 'en'),
